INSERT INTO `anunt` VALUES (5,4,'Matematica','Pregatire pentru evaluarea nationala','Ofer pregatire si suport pentru efectuarea temelor la matematica ( gimnaziu ) \r\n\r\nSedinta de pregatire se desfasoare ONLINE si dureaza 1:30 ore\r\nTarif : 80 lei/sedinta\r\nSedintele sunt INDIVIDUALE.\r\nPentru detalii va rog sa ma contactati telefonic.                             ','doua ore','2023-09-28 00:07:05',80,'Bucuresti','Bucuresti','','cinci ani',1,0,0,322,0,NULL,NULL),(7,7,'Toba','Lectii de tobe','Ofer cursuri / lectii / meditatii la tobe.\r\nExperienta de peste 10 ani.\r\nSala proprie in zona Tineretului - Timpuri Noi ( cu posibilitate de deplasare la domiciliu daca detineti set de tobe ).\r\n\r\nContact : 0762.687.527 \r\n\r\nDaca doriti sa folositi ca metoda de contact email-ul, va rog sa folositi adresa din poza de profil: crizzu27@gmail.com\r\n\r\nCRISTIAN VASILE ','o ora','2020-10-03 01:00:08',80,'Bucuresti','Bucuresti','Sala proprie in zona Tineretului - Timpuri Noi ( cu posibilitate de deplasare la domiciliu daca detineti set de tobe ).','zece ani',1,1,1,225,0,NULL,NULL),(8,8,'Limba si literatura romana','Pregatire la literatura romana pentru bacalaureat','In prezent sunt studenta la master la Facultatea de Energetica in cadrul Universitatii Politehnica Bucuresti.\r\nDoresc sa continui cultivarea ineteresului si pasiunii pentru literatura romana, subiectul meu preferat din perioada scolii si a liceului, la care am obtinut mereu rezultate foarte bune, oferind pregatire elevilor care urmeaza sa sustina examenul de bacalaureat. ','doua ore','2020-10-23 21:22:27',60,'Bucuresti','Bucuresti','Jiului/Titan','mai putin de un an',1,1,1,224,0,NULL,NULL),(11,13,'Chitara','Introducere in studiul chitarii ','    Fie ca abea te apuci de chitara si vrei sa poti canta singur melodiile preferate, sau deja canti si vrei sa-ti imbunatatesti skill-ul si sa iesi la un jam cu prietenii, hai sa programam o sedinta online :)\r\n\r\n     Cat timp ne putem vedea si auzi pe skype, zoom sau ce vrei tu, te astept sa ne cunoastem si sa vedem cum te pot ajuta!','o ora','2020-10-24 00:11:07',60,'Bucuresti','Bucuresti','','zece ani',1,0,1,227,0,NULL,NULL),(12,14,'Limba germana','Meditatii la limba germana','Ofer servicii de predare de limba germana pentru toate nivelurile de dificultate. Sedintele sunt individuale, iar pentru mai multe detalii nu ezitati sa ma contactati telefonic sau pe email. ','o ora si 30 minute','2020-10-24 23:47:06',80,'Bucuresti','Bucuresti','Bucurestii Noi','patru ani',1,1,1,196,0,NULL,NULL),(13,16,'Chimie','Meditatii chimie pentru admitere la UMFCD','Ofer meditatii la Chimie pentru bacalaureat si admitere la UMF \"Carol Davila\". Sedintele sunt on-line, cu o durata de 90 de minute iar in cadrul unei sedinte se pot discuta atat aspecte practice cat si teoretice','o ora si 30 minute','2023-02-16 12:29:22',110,'Bucuresti','Bucuresti','','cinci ani',1,0,0,427,0,NULL,NULL),(14,17,'Geografie','Meditații geografie','Buna tuturor! Ma numesc Tudor Raluca si ofer meditații la geografie pentru elevii de liceu. Iubesc geografia inca din clasele primare si ma fascinează, pentru mine a devenit un hobby. Vreau sa împărtășesc aceste noi orizonturi ale cunoașterii lumii in care trăim cu dumneavoastră, fiindca ce nu e mai frumos decât sa descoperi lucruri noi? Scopul meu este sa ajut elevii care dau examenul de bacalaureat, proba la alegere fiind geografia.\n\n***O ora si jumătate-40 de lei\n***Doua ore-45 de lei','o ora si 30 minute','2020-11-25 09:31:53',40,'Dambovita','Gaesti','','un an',1,0,1,208,0,NULL,NULL),(15,18,'Programare','Programare Python','Ofer meditatii la informatica in limbajul de programare Python la nivel de incepator si avansat pentru oricine doreste sa aiba primul contact cu programarea si doreste sa isi deschida oportunitatile profesionale pe piata muncii.','doua ore','2020-11-27 20:47:25',150,'Bucuresti','Bucuresti','Bucurestii Noi, Soseaua Chitilei','trei ani',1,0,1,199,0,NULL,NULL),(16,20,'Economie','Economie ','Bună! Mă numesc Angi Papa și sunt studentă la Academia de Studii Economice, București, anul 1, la Facultatea de Administratie si Management, specializarea Resurse umane. Ofer meditații la economie, în mediul online, ședința este de 2 ore, iar prețul unei ședinte este de 40 de lei. Se lucrează doar individual, iar toate materialele necesare pentru pregătire vor fi trimise prin mail de către mine.\n\nAdresa de mail: angipapa20@gmail.com                                                           ','doua ore','2020-12-03 04:43:58',40,'Ialomita','Urziceni','','mai putin de un an',1,0,1,365,0,NULL,NULL),(21,23,'Limba engleza','Limba engleza','meditatii orice nivel - copii si adulti -\r\nonline sau la domiciliul cursantului\r\n\r\n- imbunatatirea exprimarii in limba engleza\r\n- ajutor in pregatirea scolara\r\n- pregatire examene de limba engleza\r\n\r\nexperienta de peste 15 ani\r\nprofesoara certificare Cambridge','o ora','2021-04-15 06:43:42',30,'Bucuresti','Bucuresti','sector 5','cincisprezece ani',1,0,1,262,0,NULL,NULL),(22,28,'Limba engleza','Meditatii la engleza','Studentă la Facultatea de Litere, din cadrul Universității din București ofer meditații online atât la Limba și Literatura Română, cât și la Limba Engleză, indiferent de nivelul dvs. de studiu.\r\nStudiile personale constau în absolvirea unui liceu de prestigiu din țară, profilul uman, filologie, bilingv engleză, participarea la Olimpiada Județeană și diplome ce atestă cunoștințele lingvistice și gramaticale în limba engleză (IELTS și Cambridge, nivelul C1). Fiecare diplomă poate fi trimisă în privat, pentru asigurarea onestității.\r\nDe asemenea, în ciuda vârstei, experiența este una vastă, ofer meditații din anul 2018, am lucrat atât cu elevi de gimnaziu, cât și cu adulți care doresc să își perfecționeze limba engleză sau să obțină diploma de Bacalaureat.\r\nPentru mai multe detalii, îmi puteți trimite un mesaj. Mulțumesc anticipat!','o ora si 30 minute','2021-06-28 04:42:49',50,'Bucuresti','Bucuresti','','trei ani',1,0,1,178,0,NULL,NULL),(23,29,'Limba engleza','Ora de limba engleza ','Profesor si traducator autorizat in stiinte juridice ofer ore individuale de pregatire pentru limba engleza, ONLINE sau la domiciliu, pentru orice nivel si domeniu de activitate, inclusiv pentru sustinerea examenelor Cambridge YLE/KET/PET/FCE/CAE/IELTS General Training sau IELTS Academic.\r\nAvand mai bine de 15 ani de experienta in predare, pot structura materia in functie de necesitatile elevului si perioada de studiu disponibila. De asemenea, dispun de o mare varietate de materiale, atat in format fizic cat si electronic, care vor sta la dispozitia elevului in procesul de invatare. LET\'S MAKE ENGLISH FUN AND EASY! ','doua ore','2021-07-18 17:32:03',100,'Bucuresti','Bucuresti','Bucuresti ','douazeci de ani',1,0,1,174,0,NULL,NULL),(24,33,'Limba germana','Limba germană - meditații, cursuri, pregătire pentru examene','Bursieră a Institutului Goethe, dețin diploma Goethe-Zertifikat C1 din anul 2016 în urma unui stagiu la Bonn (Germania). Am absolvit Facultatea de Limbi și Literaturi Străine în anul 2010, secția Filologie Germană-Engleză și în 2012 Masteratul de Traduceri Literare.\r\n\r\nMöchtet ihr Deutsch lernen? Keine Sorge! Ich werde euch helfen. \r\nGuten Tag. Sunt o profesoară dedicată cu experiența în pedagogie de opt ani și investesc pasiune în ceea ce fac. \r\nAm experientă de lucru cu diferite categorii de vârstă, dedicându-mă în special copiilor și adolescenților, ca urmare a activității mele în învățământul de stat. În același timp am și experiența în lucrul cu adulții pregătind cursanți, care au trecut cu succes examenele Telc, Goethe Zertifikat sau DaF.\r\nUtilizez metode structurate și diverse, care urmăresc formarea de automatisme conversaționale și atingerea cât mai timpurie a fluenței în noua limbă.\r\n\r\nVă aștept.\r\n','doua ore','2021-10-17 16:13:18',90,'Bucuresti','Bucuresti','Sector 1','opt ani',1,0,1,177,0,NULL,NULL),(25,33,'Limba si literatura romana','Limba română - pregătire pentru Ev. Nat., Bac și alte examene','Pregătesc elevi la limba și literatură română pentru evaluarea națională și Bacalaureat, dar și alte concursuri de admitere, unde este nevoie de limba română (ex. admiterea la Facultatea de Litere). Am experiență în pregătirea acestor examene, având rezultate satisfăcătoare de-a lungul anilor. Lucrez metodic și pornesc în demersul meu pedagogic de la o sinteză a întregii materii, astfel încât elevul să aibă de la început ideile de bază a ceea ce trebuie elaborat.\r\nDe asemenea, susțin și cursuri de limba română pentru străini (în limba engleză și germană).\r\n\r\nVă aștept.\r\n','doua ore','2021-10-17 16:13:20',90,'Bucuresti','Bucuresti','Sector 1','opt ani',1,0,1,167,0,NULL,NULL),(26,33,'Alte materii','Romanian Language for Foreigners','I teach Romanian to foreigners who need the language in their profession or just want to integrate more easily into the Romanian society. I have a very good command of English, as well as German, having graduated the Faculty for Foreign Languages, German-English Department.\r\n\r\nBest regards\r\n','doua ore','2021-10-17 16:13:21',100,'Bucuresti','Bucuresti','Sector 1','opt ani',1,0,1,179,0,NULL,NULL),(27,34,'Limba engleza','Engleză în particular','Licentiat autorizat, meditez engleza orice nivel, copii/adulti, pregatire individuala interviu job,test TOEFL,IELTS,Cambridge, conversatie,gramatica,metoda moderna, engleza pentru angajati la sediul firmei. Sunt la curent cu noile metode de predare a limbilor straine, prin care cursurile se vor desfasura intr-o maniera interesanta si plina de diversitate. Seriozitate si experienta','doua ore','2021-09-21 21:36:58',90,'Bucuresti','Bucuresti','Sector 1','sapte ani',1,0,1,163,0,NULL,NULL),(28,34,'Limba germana','Limba germană: meditații','\r\nGermana este o limbă pe care unii oameni o consideră grea și de aceea s-a creat în jurul ei o aură de fortăreață de nepătruns. Ei bine, eu zic că poate fi cucerită. Sunt o fată ambițioasă și dornică să-i învăț pe alții această limbă. De aceea, o să vă fac să uitați toate aceste prejudecăți și vă voi da o nouă perspectivă.\r\nAm experiență de lucru în a predă, activând mai mulți ani la un centru de meditații, după care am început să lucrez de doi ani în sistemul de învățământ la o școală de stat.\r\nAdor ceea ce fac, în special, deoarece în această profesie am ajuns să întâlnesc tineri plini de viață și oameni interesanți, cu care ți-e drag să vorbești.','doua ore','2021-09-21 21:37:08',90,'Bucuresti','Bucuresti','Sector 1','sapte ani',1,0,1,161,0,NULL,NULL),(30,35,'Limba si literatura romana','Meditații la limba și literatura română','Numele meu este Turbatu Izabela-Cătălina și sunt studentă în anul al II-lea, la Facultatea de Litere, din cadrul Universității din București. Am terminat Liceul Pedagogic și în prezent urmez și modulul psihopedagogic la Facultatea de Psihologie și Științele Educației. Ofer meditații la limba și literatura română, pe orice platformă online. Am ales mediul virtual, deoarece este ideal pentru persoanele care au un program încărcat sau timp liber limitat.\r\nAvând o cunoaștere aprofundata a operelor literare, de la clasici până la contemporani, a conceptelor literare, a analizei textului și fiind la curent cu programa și cu subiectele de Bacalaureat din toți anii precedenți, îi voi oferi tânărului cunoștințele necesare, nu doar pentru a lua o nota de trecere, ci una foarte bună. Am experiență de un an în profesorat/ meditații și am reușit să ajut zeci de elevi să obțină rezultate îmbucurătoare la examenul de bacalaureat, într-un timp foarte scurt.\r\n\r\nSunt o persoană răbdătoare, empatică și comunicativă. Fiind tânără, am atât experiența proaspătă a celui care învață și sunt de părere că îmbinarea cunoștințelor precise cu un mediu plăcut de învățare constituie rețeta ideală pentru o acumulare eficientă de informații. Ședințele noastre se vor desfășura după metode moderne de predare și evaluare, asigurând totodată materialele didactice necesare elevului, adaptate la nivelul său de cunoștințe și structurate optim pentru o învățare cât mai facilă. De asemenea, din experiența olimpiadelor și a examenelor, îl pot îndruma pe elev spre cum să își alcătuiască o lucrare de examen/test de succes.\r\n\r\nAșadar, în ședințele pe care le ofer, îmi propun să am o interacțiune eficientă și pozitivă cu elevii, să îi motivez să învețe cu spor și drag, să le pun la dispoziție o multitudine de materiale didactice, pentru ca finalitatea să fie performanță.','doua ore','2021-08-14 03:46:11',60,'Vrancea','Focsani','','un an',1,0,1,228,0,NULL,NULL),(31,49,'Logica','Logică pentru BAC','Absolventa a Facultatii de Filosofie (Univ. Bucuresti), profesoara cu experienta de 8 ani in pregatirea elevilor, dau meditatii la logica in vederea sustinerii examenului de bacalaureat. Sedintele de pregatire se vor axa pe practica prin exercitii de tipul celor ce se dau la examen.','doua ore','2021-09-07 04:40:06',70,'Bucuresti','Bucuresti','Sector 3','opt ani',1,1,1,218,0,NULL,NULL),(32,49,'Istorie','Istoria Romanilor pentru Bacalaureat, Academie si SNSPA','Profesoara cu experienta, dedicata si entuziasta, folosind metode moderne de predare, inclusiv tehnici de memorare rapida si de comprimare a materiei, pregatesc elevii clasei a XII-a in vederea sustinerii examenelor de bacalaureat si de admitere la facultate (Academie, SNSPA). Sunt de parere ca exista diferite mijloace mult mai firesti decat simpla memorare mecanica a notiunilor, cel mai simplu exemplu fiind vizionarea unui film istoric sau povestirea pe scurt a acestora si legarea lor de timpurile noastre.','doua ore','2021-09-07 04:40:13',90,'Bucuresti','Bucuresti','Sector 3','opt ani',1,1,1,235,0,NULL,NULL),(33,53,'Biologie','Profesor Medicina','Profesor cu experienta meditez la Biologie pentru admitere Medicina generala, Stomatologie,Medicina veterinara, Farmacie,Kinetoterapie,Bacalaureat','doua ore','2021-08-30 01:16:01',80,'Bucuresti','Bucuresti','Unirii, Pachet Protopopescu','douazeci de ani',1,0,1,227,0,NULL,NULL),(34,53,'Chimie','Profesor Medicina','Profesor cu vechime meditez la chimie pentru admiterea la Medicină ,Farmacie,Bacalaureat','doua ore','2021-08-30 01:19:56',80,'Bucuresti','Bucuresti','Unirii, Pachet Protopopescu','douazeci de ani',1,0,1,223,0,NULL,NULL),(36,61,'Matematica','Meditatii matematica','Ofer meditatii la matematica pentru clasele I-XII pentru aprofundarea materiei, rezolvarea temelor, pregatirea pentru teste, teze, examene, dar si pentru umplurea golurilor si pe aspectele neintelese suficient la scoala.\r\nDetin experienta de 4 ani in pregatiri. \r\nSunt o persoana rabdatoare si reusesc sa ma adaptez pe nevoile fiecarui elev. \r\n\r\nSedinta va fi de 2 ore si poate dura mai mult daca este nevoie fara costuri suplimentare. \r\nPentru mai multe intrebari si nelamuriri puteti sa ma contactati fara probleme. \r\n\r\nVa astept cu drag!','doua ore','2021-09-19 18:39:15',60,'Iasi','Iasi','Gara','patru ani',0,1,1,183,0,NULL,NULL),(37,61,'Biologie','Meditatii admitere UMF','Studenta in anul IV in cadrul UMF Iasi, specializarea Medicina Generala ofer meditatii la biologie pentru pregatirea <b>examenului de admitere la UMF</b>. Sunt o persoana rabdatoare si reusesc sa ma adaptez pe nevoile fiecarui elev. \r\n\r\nOfer <b>scheme explicite exact pe materia de la admitere, materiale ajutatoare pentru a intelege informatiile intr-un mod logic si usor</b>. Sedinta va consta in parcurgerea unei portiuni de materii care va fi explicata cu ajutorul desenelor reprezentative, scheme realizate impreuna cu elevul si tot ce este relevant pentru portiunea de materie in cauza. Dispun si de <b>atlase si imagini clare</b> care vor ajuta vizual la intelegerea textului din manualul de biologie. \r\n\r\nLa sfarsitul fiecarei sedinte <b>elevul va rezolva grile din capitolul facut saptamana trecuta si le vom corecta impreuna</b>. Greselile facute vor fi explicate. Aceasta metoda are mai multe roluri: <i>de a obisnui elevul cu modul de examinare in timpul admiterii, pentru evaluare progresului si a detecta lacune</i>. \r\n\r\nPentru mai multe intrebari si nelamuriri puteti sa ma contactati fara probleme.\r\n\r\n <i>Va astept sa invatam cu drag Anatomia si Fiziologia omului!</i>','doua ore','2021-09-19 18:39:17',60,'Iasi','Iasi','Gara','patru ani',0,1,1,142,0,NULL,NULL),(38,61,'Anatomie','Meditatii admitere UMF','Studenta in anul IV in cadrul UMF Iasi, specializarea Medicina Generala ofer meditatii la biologie pentru pregatirea <b>examenului de admitere la UMF</b>. Sunt o persoana rabdatoare si reusesc sa ma adaptez pe nevoile fiecarui elev. \r\n\r\nOfer <b>scheme explicite exact pe materia de la admitere, materiale ajutatoare pentru a intelege informatiile intr-un mod logic si usor</b>. Sedinta va consta in parcurgerea unei portiuni de materii care va fi explicata cu ajutorul desenelor reprezentative, scheme realizate impreuna cu elevul si tot ce este relevant pentru portiunea de materie in cauza. Dispun si de <b>atlase si imagini clare</b> care vor ajuta vizual la intelegerea textului din manualul de biologie. \r\n\r\nLa sfarsitul fiecarei sedinte <b>elevul va rezolva grile din capitolul facut saptamana trecuta si le vom corecta impreuna</b>. Greselile facute vor fi explicate. Aceasta metoda are mai multe roluri: <i>de a obisnui elevul cu modul de examinare in timpul admiterii, pentru evaluare progresului si a detecta lacune</i>. \r\n\r\nPentru mai multe intrebari si nelamuriri puteti sa ma contactati fara probleme. \r\n\r\n<i>Va astept sa invatam cu drag Anatomia si Fiziologia omului!</i>','doua ore','2021-09-19 18:39:18',60,'Iasi','Iasi','Gara','patru ani',0,1,1,147,0,NULL,NULL),(39,62,'Biologie','Pregătire admitere Medicina ','Student la medicină in anul V, ofer meditații la biologie pentru admitere. Este al patrulea an consecutiv de când prestez această activitate și tind numai spre rezultate favorabile, ce se pot realiza doar cu oameni serioși și muncitori. \r\nMai multe detalii se discută la telefon.','doua ore','2021-12-09 22:57:42',40,'Dolj','Craiova','1 mai ','trei ani',1,0,1,160,0,NULL,NULL),(40,63,'Limba engleza','Meditații limba engleză ','Ofer meditații la limba engleză nivel incipient, intermediar si avansat. Sunt absolventa a universității Durham, din Marea Britanie, și dețin certificare TEFL de predare a limbii engleze ca limba straina. Ședințele sunt structurate in funcție de nevoile studentului/studenților, dar in general lecțiile vor cuprinde cele patru competente principale de reading, listening, writing, speaking. Ofer pregătire specializată pentru examene și certificări precum IELTS, Cambridge, TOEFL, sau examene bilingv/bacalaureat. Ședințele au ca scop pregătirea studenților pentru diferite examene sau pur și simplu consolidarea cunoștințelor de limba engleză pentru uzul personal. Acestea se desfășoară online, pe Skype sau Zoom. Pot fi contactata la următoarea adresa de email: iamsimina@gmail.com, la care răspund prompt. ','o ora','2021-09-29 05:41:04',80,'Valcea','Ramnicu Valcea','','un an',1,0,1,157,0,NULL,NULL),(41,64,'Logica','Meditații la Logică, Filosofie sau Limba latină','Salut!\r\nOfer meditații la oricare dintre cele 3 materii de mai jos, prețul fiind același, indiferent de materie:\r\n1. Logică (pentru BAC)\r\n2. Filosofie (pentru BAC)\r\n3. Limba latină (pentru îmbunătățirea notelor de la clasă)','o ora si 30 minute','2021-09-29 07:44:23',75,'Bucuresti','Bucuresti','Policlinica Titan','trei ani',1,0,1,159,0,NULL,NULL),(42,66,'Limba si literatura romana','Meditatii - Lb. și Lit. Română - Bacalaureat','Bună seara! Mă numesc Militaru Mario și sunt absolvent al Facultății de Litere, licențiat cu nota 10 în filologie, specializarea limbă și literatură română - limbă și literatură engleză, domeniul științe umaniste. De asemenea, am absolvit și modulul psihopedagogic, nivelul I. Momentan sunt masterand in cadrul programului \"Studii Culturale Britanice\", Facultatea de Limbi si Literaturi Straine, Universitatea Bucuresti.\r\n\r\nDesfășor această activitate de aproximativ patru ani de zile și mărturisesc faptul că mă recomandă atât rezultatele anterioare (sunt dispus să ofer și referințe, în cazul în care acestea sunt necesare), cât și pasiunea mea pentru literatura română. Personal, cred în faptul că examenul de Bacalaureat poate să reprezinte o experiență plăcută și o minunată provocare pe plan personal. Obiectivul meu principal este să îmi ajut elevii să înțeleagă informațiile ce țin de literatura limbii române, și nu să tocească mai multe comentarii \"papagalicește\". În momentul de față mai am două locuri libere la pregătire. Regimul de desfășurare a ședințelor poate să fie, în funcție de preferințe, online sau fizic, la domiciliul meu (Șos. Panduri).\r\n\r\nPentru a mă contacta, puteți să-mi scrieți un mesaj pe whatsapp sau să mă apelați în intervalul orar 10-21. Rog seriozitate și vă mulțumesc anticipat!\r\n\r\nPrețuri:\r\nședință de 1h30 - 80 de lei\r\nședință de 2h - 100 de lei','doua ore','2022-09-25 06:28:26',100,'Bucuresti','Bucuresti','Sos. Panduri 13, Sector 5','patru ani',1,0,1,170,0,NULL,NULL),(43,85,'Limba engleza','Ofer meditatii la limba engleza | Cambridge & IELTS','Predau in particular limba engleza pentru a te ajuta sa iti atingi scopurile. \r\n\r\nPutem aborda metode atat moderne cat si cele traditionale, prin care viitorul cursant sa poata alege calea care i se potriveste cel mai bine.\r\n\r\nDetin o serie de materiale Cambridge si IELTS de care ne putem ajuta sa ne formam un orar care sa va faciliteze modul de invatare.\r\n\r\nIn prima sedinta, cursantul va primi un test personalizat care ma va ajuta sa imi dau seama de nivelul acestuia si pentru a vedea ce materiale si unde trebuie sa lucram mai exact.\r\n\r\nMa puteti contacta oricand la numarul de telefon afisat.','doua ore','2021-11-09 21:12:55',90,'Bucuresti','Bucuresti','Bulevardul Ion Mihalache 15-17','cincisprezece ani',1,1,1,165,0,NULL,NULL),(44,86,'Limba engleza','Profesor pentru tine!','REDUCERE DE PRET, 70 LEI/SEDINTA, VALABILA NUMAI IN LUNILE NOIEMBRIE SI DECEMBRIE!\r\nPersoanele care incep cursul de limba engleza in luna noiembrie sau decembrie, vor beneficia de o reducere de pret semnificativa, de la 100 lei, la 70 lei!\r\n\r\nProfesor cu experienta, predau limba engleza in mod INDIVIDUAL, folosind MATERIALE CREATE DE MINE, rezultate in urma practicii indelungate de predare a limbii engleze.\r\n\r\nUrmaresc o programa și o planificare personalizate, pentru rezultate foarte bune la:\r\n- examenele de limba engleza\r\n- sistematizarea cunoștințelor\r\n- construirea sistematica a fluentei în vorbire.\r\n\r\nAsigur admiterea cu succes la Academia de Informatii, Academia Militara si de Politie, Scoala de Subofiteri!\r\n\r\nLucrez intensiv, modern, adaptat pentru orice vârstă și nivel.\r\n\r\nPersoanele adulte, incepatoare, se simt in siguranta cu mine, deoarece am rabdare si intelegere, precum si tehnica necesara insusirii limbii engleze de la zero.\r\n\r\nSunati-ma cu incredere, chiar si in week-end. Eu sunt o persoana activa si va voi raspunde pe loc, cu toate detaliile necesare, pentru a incepe o colaborare fructuoasa, pe termen lung!','o ora si 30 minute','2021-11-11 22:58:48',70,'Prahova','Ploiesti','Caraiman','cincisprezece an',1,0,1,155,0,NULL,NULL),(45,87,'Matematica','Ajut copiii sa fie inteligenti si destepti, iubind matematica','MATEMATICIAN. Obiectivul este preluarea graduala si rapida de catre elevi a abilitatilor de rezolvare a problemelor de matematica. Admiterea in liceu, bacalaureatul, admiterea in facultate sunt perfect fezabile. Asigur fise sintetice, variate baterii specifice de teste si raspunsuri pe whatsapp. Cu experienta de 40 de ani in meditatii, vom lucra eficient la dezvoltarea deprinderilor matematice si la cresterea increderii in fortele proprii, cu sanse certe de reusita. Bucuresti, Pta. Sf. Voievozi. Telefon: 0722251766.   ','doua ore si 30 minute','2023-01-07 23:58:14',150,'Bucuresti','Bucuresti','Piata Sfintii Voievozi,Str. Moxa, Liceul de muzica George Enescu','mai mult de douazeci si cinci de ani',0,0,1,164,0,NULL,NULL),(46,88,'Limba engleza','Meditatii de limba engleza pentru copii','Ofer meditatii de limba engleza pentru copii, avand experienta necesara lucrului cu copiii, indiferent de clasa de varsta. Orele se pot defasura la domiciliul elevului, in orasul Pantelimon sau in sistem online.','o ora','2021-11-15 19:21:25',50,'Bucuresti','Bucuresti','','trei ani',1,0,1,154,0,NULL,NULL),(47,89,'Limba engleza','Meditatii Limba Engleza','Engleza a reprezentat dintotdeauna o pasiune pentru mine , de aceea din dragoste fata de aceasta limba ,am ales sa ajut pe oricare doritor in a o invata. Pe cat este de frumoasa , pe atat este de cautata . Cu ajutorul unui profesor bun , oricine va putea excela in comunicarea , scrierea si intelegerea acestei limbi . Va veti convinge inca din primele sedinte ca invatarea englezei este mai usoara de cat v-ati inchipuit ! ','o ora si 30 minute','2021-11-27 04:29:18',60,'Bucuresti','Bucuresti','Plaza sector 6','doi ani',0,0,1,143,0,NULL,NULL),(48,92,'Fotografie','Tehnici esentiale de fotografie','Fotografia reprezinta pentru mine o pasiunea extraordinara pe care doresc sa v-o impartasesc prin tehnici cat mai naturale. Vom merge impreuna prin parc si vom invata elementele esentiale de incadrare a naturii statice, parcurgand cativa pasi extrem de simpli si eficienti. Cu siguranta veti descoperi multe lucruri pe care le apreciati inconstient si pe care le veti putea pune in practica pe urma. Se vor acoperi atat sendintele propriu-zise de fotografiere, cat si cele de editare. ','o ora si 30 minute','2021-12-10 09:01:13',60,'Timis','Timisoara','Calea Sagului','opt ani',0,0,1,152,0,NULL,NULL),(49,93,'Limba germana','Meditatii limba germana clasele V-XII+pregatire atestat german','Ofer meditatii la limba germana incluzand ajutor la teme, pregatire pentru teste si conversatie in limba germana copiilor de liceu si gimnaziu dar nu mai mici de 12 ani sau celor care vor sa se pregateasca pentru examenul de atestat de germana nivele A1 A2 B1 B2 C1.Pot ajuta si studentii care studiaza germana ca limba straina.Desfasurare orelor este online pe platforma Google Meet.  ','doua ore','2023-10-08 02:22:22',50,'Sibiu','Sibiu','','doi ani',1,0,0,167,0,NULL,NULL),(50,96,'Limba germana','Meditații/ cursuri limba germană','Profesor în învățământul preuniversitar și masterandă în cadrul programului Didactica Limbii germane a Universității din București si la Ludwig-Maximilians-Universität din München, susțin cursuri online de limba germană, ofer îndrumare, consolidare pentru teme și pregătire pentru examene de limbă germană pentru orice nivel, centrate pe dezvoltarea celor 4 competențe lingvistice conform Cadrului European Comun de Referinţă pentru Limbi Străine în cadrul ședințelor individuale sau în grupe de maxim 4 cursanți cu același nivel de limba germană.\r\nÎn cadrul cursurilor de limba germană, participanții se pregătesc să facă față situațiilor de comunicare din viața reală, își depășesc teama de a vorbi prin jocuri de rol si exercitii de manipulare a vocabularului in diferite contexte.\r\nVă invit să urmăriți materialele postate pe paginile de facebook și instagram, unde promovez învățarea limbii germane.\'\r\n\r\nCursurile se desfășoară pe platforma Zoom.\r\nPentru dobândirea tuturor competențelor lingvistice (înțelegere și producere de mesaj scris și oral) corespunzătoare unui nivel intermediar  (A1.1, A1.2 și așa mai departe până la C1) sunt necesare 60 de ore de predare + minim 100 ore de studiu individual. Asta înseamnă:\r\n- 7 luni pentru  2 cursuri x 50 de minute /  săptămână \r\n- 3,5 luni pentru 4 cursuri de 50 de minute/ săptămână\r\nAcestea este număr real de ore necesar pentru a dobândi un nivel intermediar. \r\n\r\nTarifele/ cursant sunt următoarele:\r\n4 cursanți: 15€ lei / 50 minute\r\n3 cursanți: 17€/ 50 minute\r\n2 cursanți: 20€/ 50 minute\r\n1 cursant: 30€/ 50 minute\r\n\r\nSpecifiul cursurilor: \r\n- metode de predare moderne, bazate pe comunicare, astfel încât veți vorbi în limba germană încă de la primul curs\r\n- profesorul vorbește preponderent în limba germană în cadrul cursului pentru a vă expune contactului cu limba într-o măsura cât mai mare. Nu vă faceți griji, profesorul se va asigura că ați înțeles ceea ce vi se transmite, cursul fiind structurat sub forma unui dialog \r\n\r\nVeți primi factură la finalul lunii. Plata se face prin transfer bancar. \r\n\r\nPagina pentru invatarea limbii germane: https://www.facebook.com/profile.php?id=100077025863871','o ora','2023-08-22 05:15:11',150,'Bucuresti','Bucuresti','','sapte ani',1,0,0,163,0,NULL,NULL),(51,97,'Canto','Meditatii, cursuri de muzica - Canto clasic si pop','Egle Chisiu, cantareata lirica, soprana, cu studii in Lituania, Italia si Romania, profesionist liber, cu experienta pe scenele lirice din Lituania, Italia si Romania, ofer lectii de Canto pentu copii, adolescenti si adulti.\r\nMa ocup de dezvoltarea corecta a respiratiei, sustinerii sunetului, marirea ambitusului vocal si pastrarea naturaletii vocii. Lucrez atat cu iubitori de muzica clasica, cat si de cea usoara.\r\n\r\nLa copiii mici pot combina ora de pian si teorie muzicala simpla cu dezvoltarea vocii.\r\n\r\nOrele se tin la Bucuresti, sec.6./ sau online.\r\n\r\n60 lei / 1 ora\r\n50 lei / 45 min.\r\nPretul pt orele la domiciliul elevului discutam separat, depinde de distanta de la Crangasi.\r\n','o ora','2022-02-01 02:10:31',60,'Bucuresti','Bucuresti','Crangasi','zece ani',1,1,1,131,0,NULL,NULL),(56,98,'Matematica','Meditații matematica ','Ofer meditații la matematica pentru elevii claselor V-VIII','o ora si 30 minute','2022-02-03 06:47:49',60,'Bucuresti','Bucuresti','Ilfov chiajna','patru ani',0,1,1,131,0,NULL,NULL),(57,99,'Biologie','Meditatii Biologie','Medic specialist medicina interna ofer meditații la  biologie pentru admiterea la medicina, stomatologie, farmacie, kinetoterapie, Tehnică dentară, Facultatea de moașe și asistenta medicala, biologie pentru pregătire examen bacalaureat, precum si îndrumare și pregătire pentru examenul de intrare în rezidentiat.\r\nCost ședința 2 ore pentru biologie cls 11 =100 ron\r\nCost ședința pregătire 2 ore  pentru examen rezidentiat=200 ron\r\nRelații prin sms/WhatsApp la nr 0785841540\r\nOfer seriozitate, rog seriozitate!','doua ore','2022-02-07 05:19:08',100,'Bucuresti','Bucuresti','','doi ani',1,0,1,111,0,NULL,NULL),(59,101,'Limba engleza','Ofer meditatii pentru orice nivel','Ofer cursuri individuale online sau la domiciliu pentru orice nivel, atat pentru copilasi cat si pentru adulti. \r\n\r\nVom lucra cu manuale certificate Cambridge si cu materiale digitale pe care eu le voi pune la dispozitie. \r\n\r\nPentru mai multe detalii, va rog sa ma contactati la adresa de email simona.radoi82@yahoo.ro ','doua ore si 30 minute','2022-04-16 02:10:07',80,'Buzau','Buzau','Parc Marghiloman','zece ani',1,1,1,66,0,NULL,NULL),(60,102,'Informatica','Ofer meditatii la informatica','Ofer meditatii la matematica si informatica ( limbajul C/C++) pentru clasele I-XII:\r\n- initiere in programare pe intelesul copiilor mici\r\n- intelegerea si aprofundarea materiei scolare\r\n- suport pentru examenul de bacalaureat, evaluare nationala, teze si teste\r\n- concursuri scolare\r\nMentionez ca sunt absolventa a Facultatii de Matematica si Informatica, am absolvit un profil de matematica-informatica intensiv (cu media 10 la ambele materii la BAC) si am experienta in predare.','doua ore','2022-06-27 21:51:09',100,'Bucuresti','Bucuresti','Gorjului','trei ani',1,0,1,64,0,NULL,NULL),(61,104,'Chimie','Meditații biologie/chimie pentru bacalaureat','Salut! Sunt Mihai, proaspăt absolvent de liceu (profil real, specializarea științe ale naturii), din toamnă boboc la Facultatea de Biologie (secția Biochimie) din cadrul Universității din București. Meditez elevi care întâmpină probleme la biologie (anatomie și fiziologie, genetică și ecologie umană) sau chimie (organică), pentru examenul de bacalaureat. Dețin lecții și teste (concepute și structurate de mine), materiale pentru înțelegerea mai eficientă a celor predate. Sunt o fire calmă, disponibilă pentru a ajuta. Cer și ofer seriozitate. Ședințele se desfășoară online, din rațiuni de timp, distanțe etc; durează o oră sau mai mult (depinzând de nevoia fiecăruia...), se desfășoară individual. \r\nAștept să ne cunoaștem! :)','o ora','2022-06-30 12:42:05',30,'Bucuresti','Bucuresti','','un an',1,0,1,56,0,NULL,NULL),(62,108,'Matematica','Meditatii MATEMATICA','Ești elev de gimnaziu sau liceu și ai nevoie de cineva priceput care să îți explice noțiunile de matematic, informatică,fizica, biologie sau limba romana pe care acum le consideri dificile? Profesorul de la școală te face să respingi materia? Vrei un rezultat mai bun la Bacalaureat, la Evaluarea Națională sau la Admitere?\r\n\r\nExperienta mea te va conduce catre performanta si catre un start bun in cariera!\r\n\r\n100 lei / 2 ore - sector 4 - Constantin Brâncoveanu\r\n\r\nMEDITATIILE SE DESFĂȘOARĂ DOAR LA DOMICILIUL MEU SI ONLINE!\r\n\r\nSunt absolventă a facultății de Automatica si Calculatoare, UPB, fostă olimpică națională la matematica și informatică, cu rezultate foarte bune la bacalaureat și admiterea la facultate, ofer meditatii (recuperarea materiei, Bacalaureat, ajutor pentru promovarea corigențelor, pregătire pentru concursuri si olimpiade,admitere la facultate ) elevilor de clasele 1-12 inclusiv in vacante si weekend-uri.\r\nAm rabdare si abilitati pedagogice foarte bune, iar pasiunea pentru matematică si stiintele exacte este moștenită din familie si cultivata inca de la o varsta frageda de tatal meu, profesor de matematica.\r\nCer si ofer seriozitate.\r\nMentionez ca am modulul pedagogic absolvit si experienta vasta in domeniu.\r\nElevii pregatiti de mine au avut rezultate bune si foarte bune la examene si concursuri scolare.\r\n\r\nAn curent-Bacalaureat nota cea mai mare- 10.00\r\nAn curent-Bacalaureat medie generala a elevilor - 9.40\r\nANUAL am 100% elevi admisi la PO