pretul afisat este pentru sedinte de grup de minim 2 si maxim 3-4 persoane de aceeași clasa si acelasi nivel!\r\nPretul pentru sedinta individuala este de 150 de lei.','doua ore','2022-07-15 04:09:26',100,'Bucuresti','Bucuresti','Piata Sudului','zece ani',1,0,1,52,0,NULL,NULL),(67,109,'Limba engleza','Meditatii Limba Engleza+ Rezolvare proiecte/ Atestate/Teme','Salut,sunt studenta la Academia Navala \"Mircea cel Batran\" din Constanta si ofer meditații la limba engleza elevilor/studentilor ce vor sa isi imbunatateasca abilitatile de comunicare in aceasta limba, atat in interes propriu, cat si pentru a se pregati pentru admiteri, in special in domeniul militar dar nu numai. Voi pune la dispozitie materiale usor de inteles incat sedinta sa se desfasoare intr-o atmosfera placuta si benefica. Acestea difera in functie de obiectivul pe care il vom stabili la inceput, Astfel, cu vointa, engleza poate usor deveni o pasiune, ce te poate ajuta in orice domeniu vei profesa.  \r\nDe asemenea, daca acest domeniu nu te pasioneaza, pot intocmi si diferite proiecte, atestate sau pur si simplu teme de clasa, oferind explicatiile necesare.   \r\nPentru mai multe detalii va rog sa ma contactati pe whatsapp.','o ora si 30 minute','2023-09-21 00:41:46',70,'Constanta','Constanta','Constanta','doi ani',1,0,1,60,0,NULL,NULL),(68,111,'Limba franceza','meditatii limba franceza','pregatire lb.franceza orice nivel, elevi si adulti, cu accent pe limba vorbita, folosind manuale editate in Franta.\r\nExperienta de 25 de ani in invatamant.\r\nPredau la domiciliul elevului. Informatii la telefon ','doua ore','2023-09-06 04:12:41',50,'Bucuresti','Bucuresti','Sector 2','douazeci si cinci de ani',0,0,1,71,0,NULL,NULL),(69,112,'Chimie','Ofer meditatii la chimie organica atat pentru Bacalaureat','Sunt studenta la Universitatea de Medicina si Farmacie Carol Davila si ofer meditatii la chimie organica atat elevilor care vor sa isi mareasca notele de la clasa, cat si elevilor care doresc sa obtina note foarte bune la examenul de Bacalaureat. Meditatiile presupun predarea materiei integral, teste de verificare a cunostintelor si fise de lucru, precum si rezolvarea de modele de Bacalaureat din anii precedenti la chimie organica.','doua ore','2022-07-28 02:24:59',60,'Bucuresti','Bucuresti','','un an',1,0,1,44,0,NULL,NULL),(70,113,'Limba franceza','Invata franceza cu o vorbitoare nativa','Bună ziua. Sunt Sophie. Aș vrea să vă ajut să vă atingeți obiectivele cu privire la limba franceză.\r\nDe 2 ani m-am mutat în România. Știu bine dificultățile cu care ne confruntăm atunci când învățăm o limbă străină. Dar am și aflat cum să depășim obstacolele aceste și aș vrea să vă ajut și pe voi.\r\nAm o diplomă de la \"Alliance française\" pentru a preda limba franceză străinilor. \r\nMetoda mea este bazată pe conversație și pe principiul de repetării distanțată. O să vă explic mai multe detalii la primul curs. Este o metodă foarte eficientă, chiar cea mai eficientă, iar cursurile sunt plăcuți. Promit ! Nu vă veți plectisi, nici nu vă veți chinui cu regulile dificile gramaticale \r\nApropo ... primul curs e gratuit și durează aproximativ 30 de minute.\r\nVă aștept cu drag la curs, ca să reușiți să vă atingeți obiectivele!\r\nMa puteti contacta pe whatsapp +33 6 68 54 12 33','o ora','2022-08-02 03:06:59',50,'Buzau','Nehoiu','','mai putin de un an',1,1,1,71,0,NULL,NULL),(71,115,'Matematica','Matematica pe întelesul tuturor','Pregătire personalizata in domeniul matematic pentru copii aflați in ciclul primar si gimnazial.\r\nStructurarea informației pe întelesul oricui. Suport de curs GRATUIT.\r\n\r\nPregătire specializată pentru absolvirea examenului de capacitate.','o ora si 30 minute','2022-08-12 06:15:15',100,'Bucuresti','Bucuresti','','cinci ani',1,0,1,59,0,NULL,NULL),(72,115,'Limba germana','Curs de germana pe întelesul oricui','Curs de germana pentru începători pe întelesul oricui','o ora','2022-08-12 06:17:04',100,'Bucuresti','Bucuresti','','trei ani',1,0,1,72,0,NULL,NULL),(73,116,'Informatica','Meditiatii cariera in programare Mobile Android/Java/Kotlin/POO','Salutari! Numele meu este Radu, sunt absolvent al Universitatii Ovidius din Constanta, facultatea de Matematica si Informatica(specializarea Informatica) si sunt aici pentru a va indruma in cariera dvs. de programator.\r\n\r\nServiciile mele constau in dezvoltarea tehnicilor dvs. de programare(si nu numai) privind:\r\n- programarea orientata pe obiecte (Java/Kotlin) \r\n- platforma Android (pref. Kotlin/Java) - tehnici de baza, medii si/sau avansate\r\n- Java / Kotlin\r\n- interviurile de angajare (tips&tricks)\r\n\r\n- tehnologiile WEB (HTML+CSS+JavaScript) - tehnici de baza\r\n- Python - tehnici de baza\r\n\r\nDin motive evidente nu o sa imi introduc numarul de telefon in mod direct aici. Cei interesati, cei care doresc mai multe detalii(i.e. CV) sau doresc sa imi puna mai multe intrebari despre serviciile mele, ma pot contacta la cr.meditatii@gmail.com.\r\n','o ora','2022-08-24 21:51:24',150,'Constanta','Constanta','','mai putin de un an',1,0,1,100,0,NULL,NULL),(74,117,'Matematica','Meditații Matematica 5-8 zona Drumul Taberei','Buna ziua, mă numesc Alexandru Stefan, sunt masterand la Universitatea Politehnica din București si ofer pregătire particulară la matematica elevilor de gimnaziu de mai bine de 4 ani. \r\nCeea ce mă recomanda si ceea ce pot garanta, pe lângă cunoștințele concrete la materia predata este experiența in a forma o buna relație atât cu părinții, cat si cu elevii, pentru a crea un mediu prietenos si motivant pentru învățare. \r\nSesiunile de pregatire se desfasoara la mine acasa(locuiesc in drumul taberei) sau in online si vor dura 2h.\r\n','doua ore','2023-09-29 21:27:52',100,'Bucuresti','Bucuresti','Drumul Taberei','patru ani',1,0,1,69,0,NULL,NULL),(75,118,'Matematica','Meditații Matematică ','Acord meditații la matematică pentru: *pregătire bacalaureat *pregătire admitere învățământ superior *admitere colegii; *pregătire evaluare națională; *orice nivel, clasele I-XII.\r\n\r\nMa adresez celor care doresc să înțeleagă matematica si/ sau informatica, sa învețe in mod logic si responsabil, pentru că explic pe înțelesul elevului. Meditez din anii studenției, sunt profesor de liceu, am pregătire si experiență pedagogică si sunt fondatorul Centrului de Pregătire și Meditații Z.\r\nȚelul meu este ca elevul sa înțeleagă noțiunile expuse si să devină motivat în a învăța din plăcere.\r\nPretul difera in functie de clasă, cerinte și modul de lucru(individual sau in grupa de doi cursanti).\r\n\r\n Înscrieri și detalii telefonic, in intervalul orar 12.00-18.00,  de luni până sâmbătă.  ','o ora si 30 minute','2023-10-14 00:12:57',100,'Constanta','Constanta','Constanța ','mai mult de douazeci si cinci de ani',1,0,1,59,0,NULL,NULL),(76,118,'Informatica','Meditații Informatică ','Acord meditații la Informatică pentru: *pregătire bacalaureat *pregătire admitere învățământ superior *rezultate scolare mai bune, nivel liceal.\r\n\r\nMa adresez celor care doresc să înțeleagă informatica, sa învețe in mod logic si responsabil, pentru că explic pe înțelesul elevului. Meditez din anii studenției, sunt profesor de liceu, am pregătire si experiență pedagogică si sunt fondatorul Centrului de Pregătire și Meditații Z.\r\nȚelul meu este ca elevul sa înțeleagă noțiunile expuse si să devină motivat în a învăța din plăcere.\r\nPretul difera in functie de clasă, cerinte și modul de lucru(individual sau in grupa de doi cursanti).\r\n\r\n Înscrieri și detalii telefonic, in intervalul orar 12.00-18.00,  de luni până vineri. ','o ora si 30 minute','2023-10-14 00:12:54',150,'Constanta','Constanta','Constanța ','mai mult de douazeci si cinci de ani',1,0,1,52,0,NULL,NULL),(77,119,'Biologie','Meditație Biologie Online','Studentă anul IV la Medicină generală și Farmacie, ofer meditații la Biologie pentru cei care se pregătesc pentru Bacalaureat la Biologie și/sau Admitere la facultățile de Medicină Generală și Farmacie, inclusiv formele scurte(Balneofizikionetoterapie, Asistență medicală și altele).\r\n\r\nPregătirile se desfășoară exlusiv online și au loc pe platforma Google Meet, fiind totodată un mediu organizat și interactiv!\r\n\r\nPentru că nu este nimic mai important decât siguranța elevului, acesta va primi o factură aferentă fiecărei ședințe(efectuată și eliberată de către o persoană autorizată)!\r\n\r\nNu lăsa procrastinarea să învingă și începe pregătirile din timp!\r\nPreț/oră: 50RON\r\nPentru mai multe detalii: 0726998693(whatsapp-mesaj), sau în privat! Vă invit pentru o comunicare cât mai eficientă, să-mi lăsați un mesaj!','doua ore','2022-09-22 07:50:30',100,'Bihor','Oradea','','patru ani',1,0,1,47,0,NULL,NULL),(78,121,'Psihologie','Pregatire Psihologie - Examenul de Bacalaureat','Salutare! ^-^ \r\nMa numesc Sandra și vreau să te ajut să promovezi examenul de Bacalaureat la psihologie cu o notă satisfăcătoare pentru tine. Vom parcurge fiecare lecție din programă împreună, mă voi asigura că limbajul folosit în manual este digerat cu ușurință de către tine, îți voi explica structura examenului și te voi ajuta să înțelegi cât mai bine materia, astfel încât să îți fie ușor să o înveți cât mai eficient. La fiecare oră vom recapitula lecția anterioară, vom face câteva exerciții tip grilă și nu numai (conform structurii examenului). Vom lucra pe subiectele din anii anteriori și din culegerile de psihologie pe care le dețin, iar cu mine am toată răbdarea și toată înțelegerea pe care ți le pot oferi pentru a eficientiza procesul de învățare. :)','o ora si 30 minute','2022-09-23 23:40:15',65,'Bucuresti','Bucuresti','','un an',1,1,1,41,0,NULL,NULL),(79,123,'Limba italiana','Italiana online','Ciao, predau limba italiana pt straini in doua scoli private din Roma si dau meditatii online pe platforma Zoom. Profilul studentilor mei este variat: copii de la 8 ani in sus, printre care si elevi de la scoala italiana Aldo Moro din Bucuresti; studenti universitari (cum ar fi Università Bocconi din Milano) care pregatesc examene de italiana; candidati care se pregatesc pt. examenul CELI; emigranti cu diferite nivele de scolarizare si origine (America de Sud, Franta, SUA, chiar si tibetani).\r\nStudiul limbi italiene este o activitate care nu se opreste la insusirea unei noi limbi ci va va imbogatii din punct de vedere cultural si emotional. \r\nNON è MAI TROPPO TARDI PER INIZIARE! A PRESTO!\r\n','o ora','2022-09-29 22:58:06',120,'Bucuresti','Bucuresti','','noua ani',1,0,1,45,0,NULL,NULL),(80,127,'Limba engleza','Meditatii Engleza','Absolventa Filologie, cu modul psihopedagogic, am experienta de peste 10 ani in comunicare cu englezi nativi si, experienta 6 ani intr-o companie multinationala care activeaza in domeniul traducerilor.\r\nOfer meditații la limba engleză si franceza, inclusiv online, pentru începători și intermediari, elevi de toate varstele, pentru cei care doresc sa invete engleza la nivel conversational, pentru examene, sau celor care au nevoie de traduceri. 6RON/1.5h\r\n','o ora si 30 minute','2022-10-01 05:23:28',60,'Timis','Timisoara','','zece ani',1,0,1,43,0,NULL,NULL),(81,129,'Limba engleza','Meditații la Limba Engleză','Meditez elevi la Limba Engleză având abilitatea de a preda și de a învăța orice copilaș (generală și gimnaziu), indiferent de nivelul de la care ne începem colaborarea. Utilizez metode moderne de predare (interactive și distractive) asigurând totodată materialele didactice necesare, adaptate la nivelul său de cunoștințe. În cadrul cursurilor voi pune accent pe conversaţie, vocabular, gramatică, scrierea şi compunerea corectă a textelor și înţelegerea acestora. Cursurile se vor desfășura la adresa meditatorului, elevului (BUCUREȘTI) sau chiar online. O ședință este 90 RON cu durată de 1h30. Pentru mai multe detalii vă aștept să mă contactați!','o ora si 30 minute','2022-10-12 10:13:48',100,'Bucuresti','Bucuresti','Sector 4,5,6','cinci ani',1,1,1,54,0,NULL,NULL),(82,130,'Logica','Meditatii Logica, argumentare si comunicare','Ofer meditații, online , la disciplina LOGICA și ARGUMENTARE pentru toți cei care doresc o nota foarte buna la examenul de bacalaureat și pentru toți cei care întâmpină dificultăți la această materie! \r\nCe îți pot oferi? \r\nConținutul fiecărei lecții, explicat pas cu pas, pe înțelesul tau, astfel încât rezolvarea exercițiilor implicate va fi o joaca!\r\n Toate variantele de modele de exerciții  care ar putea fi formulate, astfel încât să poți observa că dificultatea subiectelor e doar in aparenta! \r\nTot ce trebuie să știi, anumite strategii care te vor ajuta sa reții mai ușor, cât și metodele de lucru pentru fiecare subiect, astfel încât să nu mai fie loc de îndoială și eroare! Reusita garantata la examen!','doua ore','2022-10-14 00:19:42',100,'Iasi','Iasi','','zece ani',1,0,1,72,0,NULL,NULL),(83,133,'Limba si literatura romana','Ofer meditatii la limba romana, engleza, istorie și geografie','Ofer meditații la limba și literatura română, limba engleză, istorie și geografie pentru copii de toate vârstele și clasele. Am obținut nota 9,46 în examenul de Bacalaureat și am o experiență de 4 ani în pregătire copiilor. Ofer meditații la mi multe materii care aparțin profilului uman, deoarece acesta este și profilul pe care l-am terminat. În examenul de Bacalaureat am obținut nota 10 în cadrul probei la istorie, pentru engleză am făcut cursuri pentru a obține acreditare Cambridge, iar în ceea ce privește geografia, sunt absolventă a Facultății de Geografie din cadrul Universității din București. La toate materiile la care ofer meditații am acumulat ani de pregătire, un bagaj vast de cunoștințe pe care sunt nerăbdătoare să le împărtășesc cu copiii dornici să progreseze și să obțină rezultate deosebite. Sunt o persoană calmă, răbdătoare și îmi place foarte mult să lucrez cu copiii. Meditațiile se pot realiza atât online, cât și la domiciliul meu situat în Cartierul Latin pe Prelungirea Ghencea. Pot oferi atât meditații, cât și sprijin în realizarea temelor și înțelegerea aprofundată a cunoștințelor predate la școală.','doua ore','2022-11-08 06:48:40',85,'Ilfov','Bragadiru','Cartierul Latin ','patru ani',1,0,1,58,0,NULL,NULL),(84,135,'Economie','Economie','Ofer meditații la economie pentru admiterea la Facultatea de Drept (microeconomie și macroeconomie) și pentru Bacalaureat (microeconomie). Dețin materia necesară reușitei la examene. Orele se vor desfășura în funcție de nivelul de înțelegere și modul de învățare optim pentru fiecare elev, întrucât sunt o persoană calmă și înțelegătoare pe care o poți aborda cu orice fel de întrebare. Asigur fișele cu lecții și fișele cu exerciții, pe care le transmit la începutul fiecărei ore de meditații într-un document Word. Pe baza acestora voi oferi explicațiile necesare,dezvoltând fiecare noțiune în parte. De asemenea, verificarea învățării se va face prin grile asemenea celor de la examene. Am susținut examenul la Facultatea de Drept, Universitatea București, unde am dat examenul de admitere la economie, la fel ca și pe cel de Bacalaureat, la proba a III-a. Am experienta in domeniu de 4 ani, obținând cu elevii pregătiți atât nota 10 în Bacalaureat, cât și punctajul maxim pentru proba de economie la admiterea la Facultatea de Drept.\r\nMeditația se desfășoară doar Online, individual, deoarece consider că cea mai bună performanță se dobândește printr-o meditație cu o singură persoană.\r\nÎmpreună putem reuși. Pentru orice informație vă stau la dispoziție la numărul de telefon afișat, spunându-vă modul de abordare a orelor și arătându-vă o parte din fișele pe care lucrez.   ','o ora si 30 minute','2022-11-16 18:02:18',70,'Bucuresti','Bucuresti','','patru ani',1,1,0,44,0,NULL,NULL),(85,135,'Limba si literatura romana','Romana - Admitere Drept','Ofer meditații în vederea susținerii examenului de admitere la Facultatea de Drept, Universitatea din București. Ședințele de meditații se vor desfășura sistematic și în funcție de nivelul de înțelegere optim pentru fiecare elev. Dețin materialele necesare pregătirii pentru Drept ( gramatică, noțiuni de DOOM și DEX, dar și grile pentru aprofundarea materiei.) Experiență în domeniu de 4 ani. Asigur fișele cu lecții și pe cele cu exerciții in format Word, acestea fiind trimise la inceputul fiecarei ore de meditații. Sunt o persoană calmă, care are răbdare și care își dorește performanța elevilor meditați. Am susținut examenul la Facultatea de Drept, Universitatea din București, la care am intrat fără meditatii la limba romana, deși examenul este considerat a fi cel mai greu la această materie. Deci, putem reuși împreună! Meditațiile se desfășoară individual, întrucât consider că cea mai bună înțelgere se dobândește în acest mod. Acestea se desfășoară doar ONLINE.\r\n\r\nPretul este negociabil.   ','doua ore','2022-11-16 18:02:25',80,'Bucuresti','Bucuresti','','patru ani',1,0,0,56,0,NULL,NULL),(86,144,'Limba si literatura romana','Limba si literatura romana','Intampini dificultati la limba romana? Sunt aici sa te ajut! Profesor cu 7 ani de experienta, te voi asista in calatoria ta de intelegere si aprofundare a limbii si literature romane.\r\nPentru o intelegere mai buna a materiei si rezultate pe masura.\r\n\r\nAbsolventa a Facultatii de Litere, specialziarea romana-engleza, pregatesc elevii cls I-XII la limba romana (pregatire pentru clasa, examene nationale, admitere facultate). Meditatiile se desfasoara la domiciliul meu sau online.\r\n\r\n ','doua ore','2022-11-15 05:38:51',90,'Bucuresti','Bucuresti','Bucuresti sector 2','sapte ani',0,0,1,41,0,NULL,NULL),(87,146,'Chimie','Meditatii Chimie Organica','Salutare! Ma numesc Budila Sebastian-Adrian, sunt student in anul III la Facultatea de Medicina Generala, in cadrul UMF \"Carol Davila\" Bucuresti, am 23 de ani.\r\n\r\nOfer pregatire la CHIMIE ORGANICA pentru examenul de Bacalaureat sau pentru aprofundarea materiei de la clasa.\r\nSedintele se vor desfasura ONLINE si vor avea o durea de 90 de minute (1h 30 min)\r\n\r\nPot lucra individual cu elevul, dar sunt de parere ca grupurile de 2-3 persoane in cadrul unei sedinte va da rezultate mai mari deoarece poate exista intrajutorare intre participanti. Se va crea o coeziune intre participanti.\r\n\r\nCutez ca in mediul online dispunem de mai multe resurse in vederea intelegerii materiei.\r\n\r\nCer si ofer seriozitate, respect si implicare. Prima sedinta va fi gratuita pentru a vedea daca exista compatibilitate intre modul meu de a explica si felul dumnevoastra de a intelege. Nu doresc sa fie o risipa de timp si bani si de aceea recurg la aceasta alegere.\r\n\r\nPregătesc elevi și în regim intensiv în apropierea perioadei examenului de Bacalaureat.\r\n\r\nSa ne auzim cu bine!','o ora si 30 minute','2022-11-15 09:15:06',60,'Bucuresti','Bucuresti','Bucuresti','un an',1,0,1,36,0,NULL,NULL),(88,148,'Limba engleza','Meditații individuale limba engleză - online','Ofer meditații individuale la limba engleză atât pentru persoanele care sunt la început de drum, cât și pentru persoanele cu un nivel mediu-avansat. Ședințele durează o ora jumătate sau 2 ore și se vor ține online. Prețul pe ședință este de 80 lei (o ora jumătate) sau 100 de lei (2 ore)\r\nVă voi ajuta să vă atingeți țelurile, fie că este vorba de vorbire fluentă, siguranță în exprimare, înnobilarea vocabularului sau exerciții de gramatică , voi fi alături și vom forma o echipă!\r\nObișnuiesc să împart sedința în două părți, o parte teoretică și una practică. În partea teoretică acoperim noțiuni de gramatică (+ exerciții) și în partea practică ne axăm pe conversație, în special pe pronunție și accent. Dacă simțiți că stăpâniți gramatica, ne putem focusa doar pe conversații; vom discuta pe diferite articole din diferite domenii sau vom avea discuții libere. Veți observa că, ușor-ușor, cuvintele vor veni mult mai repede și vă veți simți mult mai confortabil când vă exprimați.\r\nAm studiat și locuit în Anglia 6 ani de zile, fapt ce m-a ajutat să înțeleg cultura britanică și simt că pot să împărtășesc cu succes cunoștințele acumulate. Stilul meu de predare este de a crea lecții unice care să identifice nevoile dumneavoastră și să vă ajut în satisfacerea acestora.\r\n','o ora si 30 minute','2022-11-22 21:12:54',80,'Bucuresti','Bucuresti','','cinci ani',1,0,1,34,0,NULL,NULL),(89,149,'Limba coreeana','Meditații la limba coreeană','Bună ziua, sunt studentă în cadrul Universității din București la Facultatea de Limbi și Literaturi străine. La momentul actual dețin diplome ce atestă competențele mele la Limba Coreeană. Lecţiile pregătite urmăresc pregătirea cursantului pentru examenul Topik, dar şi pentru a putea conversa fără probleme în limba coreeană. Cursantului îi sunt puse la dispoziţie toate materialele de lucru în format pdf. Să transmit şi să predau mai departe informația pe care o dețin este una dintre pasiunile mele. Sunt o fire prietenoasă şi cât se poate de răbdătoare. Am o experienţă de 4 ani, iar toți cursanții mei ce au susținut examenul Topik l-au promovat.\r\nAştept cu nerăbdare să lucrez cu dumneavoastră!\r\nCursul de desfăşoară exclusiv Online.\r\nPreț:\r\nO oră şi 30 de minute: 60 RON\r\nPachet 2 persoane: 100 RON\r\nPentru mai multe detalii vă aştept la un telefon.','o ora si 30 minute','2023-01-17 23:44:51',60,'Ilfov','Voluntari','','patru ani',1,0,0,44,0,NULL,NULL),(90,150,'Arhitectura','Pregatire pentru admitere arhitectura la desen liber si desen tehnic','Orele de pregătire se adresează celor care doresc să urmeze cursurile facultății de arhitectură din Cluj-Napoca sau universitații de arhitectură Ion Mincu București.\r\n\r\nDurata unei ședinte este de 4 ore. Pregatirea cuprinde atât partea de desen liber cât și cea de desen tehnic(geometrie descriptivă).','patru ore','2022-12-04 09:09:25',100,'Cluj','Cluj-Napoca','Gheorgheni','doi ani',1,0,1,44,0,NULL,NULL),(91,151,'Matematica','matematică Buftea','Ofer suport pentru înțelegerea lecțiilor la matematică (I – IV, V - VIII, IX – XII) și pentru pregătirea evaluării naționale și a probei de bacalaureat la matematică (mate-info, științele naturii, tehnologic și pedagogic), la domiciliul meu. 100 lei / o oră și jumătate / elev (maxim 2 elevi) sau 120 lei / o oră și jumătate - un singur elev.','o ora si 30 minute','2023-11-10 18:42:43',100,'Ilfov','Buftea','Studio','cincisprezece ani',0,0,1,67,0,NULL,NULL),(92,152,'Limba engleza','Curs ONLINE, metoda COMUNICATIVA, vorbitor NATIV','Hello! Do you speak English?\r\nVorbitor NATIV - Metoda COMUNICATIVA - cel mai important aspect al predării mele este să ajut studenții să-și dezvolte încrederea in propriile aptitudini in limba engleza!\r\n\r\n-Numele meu este Elena și sunt vorbitor nativ de engleză, si am trait in Anglia 6 ani.\r\n-Am absolvit universitatea in Marea Britanie și acum ofer lecții private de engleză online, pentru adolescenti si adulti.\r\n-Am 4 ani experienta in predarea limbii engleze, lucrand in prezent si la o scoala particulara in Franta.\r\n\r\nMETODA\r\n-Lecțiile mele se bazează pe metoda comunicativă, ceea ce înseamnă că ne vom concentra pe vorbirea și interacțiunea în engleză cât mai mult posibil.\r\n- În loc să folosim manuale plictisitoare, vom lucra cu materiale interactive precum prezentări PowerPoint, exerciții de vorbire si jocuri de vocabular.\r\n\r\nREZULTATE\r\nAproximativ 90% dintre studenții mei care încep cu cunostinte minime in limba engleză sunt capabili să vorbească la un nivel intermediar în decurs de 8 luni, iar 100% dintre studenții începători-intermediari ating un nivel avansat în 6 luni.\r\n\r\nPRETURI\r\n-Prima sesiune: 30LEI (o ora): spargem gheata si vedem nivelul de la care incepem lectiile.\r\n- 70LEI/ora\r\n- 100LEI/1h30 (curs + 30min conversatie la liber).\r\n\r\nPlățile se pot face prin Revolut sau prin transfer bancar.\r\n\r\nDISPONIBILITATE\r\nDisponibilitatea mea este limitată la marți, miercuri și joi, deoarece sunt complet ocupata luni și vineri. Incepand cu 15 Iulie voi fi disponibila si luni,vineri.\r\n\r\n\r\nAm o personalitate prietenoasă și deschisă, care îi face mereu pe elevii mei să se simtă confortabil și relaxați.\r\n\r\nUnul dintre cele mai importante aspecte ale predării mele este să ajut studenții să-și dezvolte încrederea de sine. Recomand copiilor sub 14 ani să ia lecții față în față pentru rezultate mai bune. Aștept cu nerăbdare oportunitatea de a vă ajuta să vă îmbunătățiți cunoștințele de limba engleză.\r\n\r\nCONTACT:\r\nVa astept cu drag mesajele pe pagina de facebook Elena\'s English Class sau pe Whatsapp','o ora','2023-01-15 00:47:54',70,'Bucuresti','Bucuresti','','patru ani',1,0,1,50,0,NULL,NULL),(93,154,'Limba si literatura romana','Meditații lb română și limba franceză ','Profesor de limba română, ofer meditații atât la limba și literatura română cât si la limba franceză în vederea îmbunătățirii situației școlare si promovarea examenelor naționale.','doua ore','2023-01-17 03:51:59',100,'Bucuresti','Bucuresti','','noua ani',1,1,1,56,0,NULL,NULL),(94,158,'Istorie','Ofer meditații pentru pregătirea Examenului de Bacalaureat - Istorie','Profesor de istorie, gradul I, ofer sprijin în pregătirea Examenul de Bacalaureat dar și pentru îmbunătățirea situației școlare. Modul de pregătire nu este standard, ci bazat pe metode moderne funcție de nivelul și stilul de învățare al fiecărui elev.\r\nO ședință durează 2 ore , este individualizată, și se poate desfășura atât fizic cât și online.','doua ore','2023-02-01 23:22:47',100,'Sibiu','Sibiu','Calea Dumbrăvii','douazeci si cinci de ani',1,0,1,37,0,NULL,NULL),(95,159,'Matematica','Meditatii Matematica cl. 1-8 și Evaluarea Nationala','Ofertă limitată! -> Prima noastră sesiune este gratuită.\r\n\r\nPredau o abordare provocatoare și riguroasă a învățării, care nu se rezumă doar la memorarea procesului de rezolvare și la obținerea de rezultate corecte. În schimb, le arăt elevilor mei cum să abordeze problemele în mod critic și rapid. Acest stil de învățare îi ajută pe elevi să reușească în viață, deoarece sunt capabili să rezolve probleme fără a avea nevoie de cineva care să le spună ce trebuie să facă.\r\n\r\nScopul meu este ca tu să:\r\n\r\n-să obții notele care i-ar face pe părinții tăi mândri!\r\n\r\n-să treci Evaluarea Națională și să intri la liceul pe care tu-l alegi!\r\n\r\nCred că învățarea trebuie să-ți aprindă curiozitatea, nu doar să-ți exerseze capacitatea de memorare și pot spune că sunt foarte pasionată de acest lucru. Îmi place să-mi văd elevii învățând și crescând din greșelile lor, motiv pentru care, atunci când mă angajezi, vei avea un meditator care știe cum să te ajute să înțelegi noțiunile.\r\n\r\nDacă nu ești mulțumit în urma vreunei întâlniri, spune-mi imediat și nu va trebui să și plătești pentru ea. ','doua ore','2023-02-02 22:37:35',70,'Cluj','Cluj-Napoca','Baciu','mai putin de un an',1,1,1,40,0,NULL,NULL),(97,160,'Matematica','Ofer meditatii la matematica elevilor din clasele 5-8 si 9-12','Ofer meditatii la matematica pentru clasele 5-8, de asemenea pregatesc copiii pentru examenul national. Ofer meditatii si pentru clasele 9-12 si pregatesc pentru examenul de bacalaureat. Pretul este de 90 pentru clasele 5-8 si 100 pentru clasele 9-12\r\n\r\nIn prezent sunt student la Academia de Studii Economice, mai exact la Cibernetica, sectia Informatica Economica cu predare in engleza. \r\nAm terminat liceul Grigore Moisil, profil mate info intensiv informatica,iar in bacul la matematica am luat 9,80.\r\n\r\nCeea ce mă recomanda si ceea ce pot garanta, pe lângă cunoștințele concrete in materia predata este experiența in a forma o buna relație atât cu părinții, pentru a prioritiza transparenta si cooperarea, cat si cu elevii pentru a crea un mediu prietenos si motivant pentru învățare.\r\n\r\nSedinta dureaza o ora jumatate, iar pretul difera in functie de modul in care doriti sa o desfasuram, la mine(Raul doamnei, Drumul Taberei) sau la dumneavoastra acasa. \r\n\r\nLa prima sedinta vom da un test care are rolul de a vedea la ce nivel este elevul.\r\n\r\nTema se va da obligatoriu la finalul fiecarei ore si este neaparat necesar sa fie lucrata de catre elev, intrucat va fi verificata la inceputul sedintelor. \r\n\r\nIn final, as dori sa va multumesc daca cititi acest anunt si va astept cu drag telefonul.','o ora si 30 minute','2023-07-10 00:55:20',90,'Bucuresti','Bucuresti','Drumul Taberei, Raul Doamnei','doi ani',0,0,1,58,0,NULL,NULL),(101,178,'Limba engleza','Meditatii la limba engleza','Absolventa unui master si a unei facultati cu predare in limba engleza din strainatate si a profilului bilingv-engleza din cadrul Colegiului Bilingv George Cosbuc. Detin atestat de predare a limbii engleze.\r\nOfer meditatii personalizate si interactive la limba germana si engleza pentru elevii claselor V-VIII.\r\nMeditatiile se pot desfasura atat online cat si la domiciliul elevului (Bucuresti- sectoarele 2 si 3).\r\nSa incepem impreuna aventura cunoasterii tainelor limbilor straine!\r\nLimba engleza: 75 lei /1h 30\r\nLimba germana: 85 lei/ 1h30','o ora si 30 minute','2023-02-25 01:08:53',75,'Bucuresti','Bucuresti','','un an',1,1,1,22,0,NULL,NULL),(102,178,'Limba germana','Meditatii la limba germana','Absolventa unui master si a unei facultati cu predare in limba engleza din strainatate si a profilului bilingv-engleza din cadrul Colegiului Bilingv George Cosbuc. Detin atestat de predare a limbii engleze.\r\nOfer meditatii personalizate si interactive la limba germana si engleza pentru elevii claselor V-VIII.\r\nMeditatiile se pot desfasura atat online cat si la domiciliul elevului (Bucuresti- sectoarele 2 si 3).\r\nSa incepem impreuna aventura cunoasterii tainelor limbilor straine!\r\nLimba engleza: 75 lei /1h 30\r\nLimba germana: 85 lei/ 1h30','o ora si 30 minute','2023-02-25 01:09:36',85,'Bucuresti','Bucuresti','','un an',1,1,1,23,0,NULL,NULL),(103,180,'Matematica','Meditatii matematica','Meditatii  individuale la matematica pentru pregatirea examenelor de evaluare nationala si bacalaureat,aprofundarea sau recuperarea materiei. ','doua ore','2023-02-26 09:25:29',100,'Bucuresti','Bucuresti','','noua ani',1,0,0,28,0,NULL,NULL),(104,181,'Limba chineza','Meditatii Limba Chineza','喂 (wei)! \r\n\r\nSunt absolventa UNIBUC chineza-rusa si predau limba chineza pt copii si adulti (individual/in grup) de peste 10 ani. \r\n\r\nHai sa invatam sa scriem, citim si sa pronuntam corect aceste semne denumite ideograme care sunt cheia descifrarii unei civilizatii antice! Impreuna vom descoperi lucruri interesante legate de cultura chineza si de viata lor de zi cu zi, ne putem pregati si pt certifcarea HSK 1-3 (vocabular si gramatica) sau putem doar sa conversam. \r\n\r\nVa invit cu drag sa sunati si astept cu nerabdare sa va cunosc pentru o prima sedinta gratuita!  \r\n\r\nBonus: toate MATERIALELE DIDACTICE necesare sunt INCLUSE IN PRET!\r\n','o ora','2023-03-07 20:19:24',90,'Bucuresti','Bucuresti','sector 2 Piata Iancului','zece ani',1,0,1,31,0,NULL,NULL),(105,181,'Limba engleza','Meditatii engleza orice nivel','Hello! \r\nPredau lb engleza la orice nivel, cu experienta de 20 de ani. Imi place provocarea de a gasi metoda potrivita pentru fiecare, in functie de varsta, personalitate si ariile de interes. Consider ca oricine poate sa invete orice, cu atitudinea si ajutorul potrivit. \r\n\r\nPrima sedinta este gratuita! Sedintele dureaza o ora (clasele I-IV pret 65 ron) o ora si jumatate (cls V - VIII pret 85-100 ron) sau doua ore (liceu/facultate/adulti preturi intre 100 si 160 ron, in functie de cerinte). \r\nPregatesc pt examenele Cambridge ESOL si YLE, IELTS, TOEFL etc (simulari de examen si ofer materiale de lucru). \r\nPentru alte nevoi (BAC, proiecte, lucrari licenta, traduceri specialitate) vom agrea pretul impreuna. \r\n\r\nVa invit sa sunati si astept cu nerabdare sa va cunosc! ','o ora si 30 minute','2023-03-03 20:34:15',65,'Bucuresti','Bucuresti','sector 2 Piata Iancului','douazeci de ani',1,0,1,32,0,NULL,NULL),(106,182,'Chimie','Meditatii chimie','MEDITATII ONLINE SI FIZIC\r\nCHIMIE ORGANICA SI ANORGANICA\r\n- ADMITERE FACULTATE MEDICINA / FARMACIE\r\n- EXAMEN BACALAUREAT\r\n- SUPORT DE STUDIU PENTRU STUDENTII LA FACULTATI CU DSCIPLINA DE STUDIU CHIMIE\r\n\r\n\r\nEsti pasionat/a de chimie, urmezi cursurile unui liceu de chimie, vrei sa urmezi o cariera in medicina sau farmacie sau ai nevoie de ajutor suplimentar pentru examenul de bacalaureat? Am o solutie pentru tine! \r\nSunt Cristina si meditez la chimie organica si anorganica. \r\nAcum ma ocup 100% de meditatii la chimie pentru liceu, bacalaureat si admitere la facultate, astfel ca timpul meu de lucru poate fi armonizat usor cu timpul disponibil pe care elevul il are pentru meditatii. \r\nPredau chimie pentru cei ce au nevoie sa invete, pentru ei, pentru viitorul lor, nu pentru cei care deja exceleaza in acest domeniu. \r\nCa profesor consider ca o comunicare libera, deschisa face ca intelegerea sa fie mai profunda si invatarea mai buna, iar sarcina mea ca profesor este sa ajut elevul sa inteleaga, sa fie sigur de cunostintele lui si sa le aplice cu usurinta oricand are nevoie.\r\nSunt  dublu licentiata in “Chimie” la Universitatea Bucuresti si in “Inginerie Chimica si Protectia Mediului” la Universitatea Petrol-Gaze Ploiesti si masteranda in \"Inginerie Chimica si Protectia Mediului\" la Universitatea Petrol-Gaze Ploiesti.\r\nSunt profesor de chimie cu definitivat in invatamant si experienta de predare in liceu si gimnaziu. \r\nAm experienta 10 ani in realizarea de meditatii la chimie cu rezultate foarte bune pentru examen bacalaureat si admitere la facultate. De asemenea, sunt chimist si inginer chimist cu o indelungata experienta practica de lucru in laboratoare chimice si in productie.\r\nAcestea au fost spuse despre mine, acum e randul tau sa-mi spui despre tine. Te astept in echipa mea.\r\n\r\ncristina.viiu@outlook.com\r\nFacebook\r\nhttps://meditatii.ro/meditatii/alte-materii-cristina-viiu-9979\r\nhttps://www.top100romania.club/profil/meditatii-chimie-_-cristina-viiu/\r\nuhttps://tootor.ro/teachers/viiu-cristina/2570/\r\nhttps://www.edukate.ro/inregistrare/CRISTINAV96\r\nhttps://www.edukate.ro/profesor/profil\r\nhttps://yoolearn.ro/profesor/7\r\n ','doua ore','2023-10-12 12:07:49',100,'Prahova','Ploiesti','Ploiesti, zona Mihai Bravu','zece ani',1,0,1,53,0,NULL,NULL),(107,183,'Limba si literatura romana','Meditații romana Petrosani','Profesor titular, gradul I, cu vechime de 15 ani in invatamant, ofer meditatii la limba si literatura romana elevilor din ciclul gimnazial. Sedintele se desfasoara cu un singur elev.\r\nPretul unei ore este de 50 de lei.','doua ore','2023-03-16 03:27:35',50,'Hunedoara','Petrosani','Petrosani ','cincisprezece ani',0,0,1,25,0,NULL,NULL),(108,184,'Matematica','meditatii matematica','Ofer meditatii la matematica elevilor din clasele I-VIII, doritori sa cunoasca aceasta stiinta ','doua ore','2023-03-19 00:49:35',90,'Bucuresti','Bucuresti','Str. Drumul fermei, nr.97B, Popesti leordeni','zece ani',0,0,1,30,0,NULL,NULL),(109,185,'Istorie','Meditatii Istorie','Salutare,\r\n\r\nsunt fosta olimpica la Istorie, absolventa de Istorie, si ofer cu placere meditatii la Istorie pentru Bac si alte clase. De asemenea, ofer si ore de limba engleza. ','o ora si 30 minute','2023-03-21 00:56:39',70,'Suceava','Campulung Moldovenesc','Centru','un an',1,0,1,31,0,NULL,NULL),(110,188,'Anatomie','Meditații Bacalaureat Anatomie umană','Bună ziua! \r\nMă numesc Oliviu și sunt student al facultății de medicină din Cluj Napoca, în anul 5. Pregătesc elevi ai clasei a XII-a pentru examenul de bacalaureat la biologie și pot spune că, pentru mine, este o adevărată pasiune. \r\n\r\nDoresc să ofer meditații gratuit, o dată pe săptămână, în cadrul unei ședințe de o oră și jumătate.\r\nScopul meu este strict să ajut oameni care au nevoie și care își doresc mai mult de la viața lor, dar care nu au la îndemână resursele necesare. \r\nȘedințele vor fi făcute în grupe de mai mulți elevi și vor presupune rezolvarea a câte o variantă de bac. Ziua și ora ședinței vor fi flexibile, dar anunțate din timp. În ciuda gratuității, seriozitatea și implicarea vor fi criterii eliminatorii pentru cei care vor participa.\r\n\r\nÎmi place să lucrez pe scheme, așa că, vor fi necesare un caiet pentru desene și creioane colorate. \r\n\r\nVă rog să nu mă contactați telefonic, ci prin mesaje pe Whatsapp sau SMS. Mulțumesc!\r\n\r\nȘedințele se vor ține pe platforma Microsoft Teams sau Discord.','o ora si 30 minute','2023-10-08 23:20:42',2,'Cluj','Cluj-Napoca','','doi ani',1,1,0,42,0,NULL,NULL),(112,190,'Chimie','meditatii premium','Meditații Premium Chimie orice nivel, organica/anorganica.\r\nMetodă, pregătire psihopedagogică calificată, Experiență 20 ani, simulări examene, materiale, programa EDU, pregatirea este individuala !\r\nStudii\r\nFacultatea de Chimie-Universitatea București, Licență 2015.\r\nFacultatea de Chimie Aplicată și Stiinta Materialelor/ Chimie Legală si Expertiză Criminalistică,-Univ. Politehnică Buc-Master 2017,\r\nUMF-2002.\r\nDep de Pregatire Personal Didactic-UPB, Certificat 2016-2017.\r\nImi rezerv dreptul de a selecta elevii.\r\n','doua ore','2023-05-20 03:14:51',200,'Bucuresti','Bucuresti','Nerva Traian- Octavian Goga','douazeci de ani',0,0,1,15,0,NULL,NULL),(113,191,'Matematica','Meditatii matematica ','Incep înscrierile pentru perioda verii,perioada ideala pentru recapitularea materiei,mai ales pentru elevii care au terminat clasele a 7-a sau a 11-a.Ofer meditații la matematică pentru elevi de clasele 9-12.Sunt meticuloasa,indragita de elevi,am experienta in domeniu,placuta , dar exigenta si ambitioasa .In randul elevilor mei promovabilitatea este de 100%,majoritatea obtinand note peste 8.00.Explic notiunile in functie de nivelul de intelegere al fiecarui elev.Urmaresc recuperarea si aprofundarea materiei,verific temele si lamuresc lacunele existente dar si formarea unui sistem de gandire coerent si logic al elevului..Matematica poate fi asimilata si cu drag,respectand in acelasi timp rigurozitatea si exactitatea calculului matematic .Puteti obtine detalii despre desfasurarea sedintelor si facturare la telefonul afisat.Instagram math.club\r\n','doua ore','2023-06-01 19:11:08',120,'Bucuresti','Bucuresti','Drumul Taberei ','douazeci de ani',0,0,1,18,0,NULL,NULL),(114,192,'Matematica','MEDITATII MATEMATICA','Sunt studentă în anul IV la facultatea de Inginerie Mecanică și Mecatronică, din cadrul Universității Politehnica București. Ofer meditații individuale elevilor din ciclul gimnazial, dar și celor din ciclul liceal, indiferent de profil încluzând pregătire pentru examenul de Bacalaureat. Meditațiile se pot desfășura atât online, cât și față în față.','doua ore','2023-06-01 20:41:24',90,'Bucuresti','Bucuresti','Zona Drumul Taberei','trei ani',1,0,1,16,0,NULL,NULL),(115,193,'Limba spaniola','meditez spaniola','Ofer meditatii de limba spaniola online pe platforma ZOOM dar si in Bucuresti la domiciliul meu . Experienta de mai bine de 20 ani in domeniu. Predau in functie de necesitatile fiecarui cursant , adaptandu-ma la nevoile sale . Pret : 80 RON / 1 ORA SI 30 MINUTE in cazul unei singure sesiuni pe saptamana. . In cazul in care cursantul doreste 2 sau mai multe sesiuni pe saptamana pretul este 70 RON / 1 ORA SI 30 MINUTE. Ofer sedinta pilot de o jumatate de ora gratis - pentru a ne cunoaste si a identifica nivelul si necesitatile cursantului.','o ora si 30 minute','2023-06-05 22:29:59',80,'Bucuresti','Bucuresti','Bucuresti','douazeci si cinci de ani',1,1,1,20,0,NULL,NULL),(116,194,'Limba engleza','cursuri limba engleza','NEW ENGLISH CENTER este un centru de limbi străine  pentru copii, începând de la vârstă de 6 ani și până la vârstă adulta inclusiv. Organizam cursuri de limba engleză în timpul anului scolar, scoli de vara tematice în luna iulie, pregătire examene Cambridge pentru copii și adolescenți.\r\nNiveluri pregatire: A1, A2, B1, B2, C1, C2, admitere clasa a 5-a intensiv engleza, proba de competente lingvistice limba engleza din cadrul examenului de bacalaureat.\r\nCursurile noastre sunt susține de profesorii certificati cu experiență la catedra de peste 15 ani. Fiecare curs vizează dezvoltarea celor patru arii principale de învățare: ascultare, scriere, comunicare orala și citire. Copiii au suport vizual, media, manual și fise după modelul Cambridge.\r\n\r\nCursurile se desfășoară pe o perioada nedeterminata, cu o frecvență săptămânală de 1-2 lecții. În funcție de nevoile de cunoaștere și aprofundare, putem pregăti pentru orice tip de examen în limba engleză.\r\n\r\nPuteți să vă înscrieți pe adresa de email : newenglishcenter7@gmail.com\r\n\r\n ','o ora si 30 minute','2023-06-05 23:54:42',70,'Bucuresti','Bucuresti','online sau fizic','cincisprezece an',1,1,1,17,0,NULL,NULL),(117,195,'Matematica','Meditații on-line matematică ','Ofer pregătire la matematica pentru elevi de gimnaziu și clasele 1-4. Ședință durează o ora jumătate și se desfășoară exclusiv on-line.\r\nPrețul variază in funcție de clasa. \r\nAm experienta de 2 ani în domeniu și ofer sedinte de calitate. Alaturi de munca elevului, rezultatele sunt garantate.\r\nMenționez ca am premii la concursuri naționale și internaționale și iubesc lucrul cu copiii.','o ora si 30 minute','2023-06-09 18:14:27',70,'Bucuresti','Bucuresti','','doi ani',1,0,1,15,0,NULL,NULL),(118,196,'Limba franceza','Limba franceză','Ofer pregătire la limba franceză atât fizic, cât și online pentru admitere la facultate, dar si pentru examenele DELF, DALF. Seriozitatea si profesionalismul mă definesc. Am terminat Facultatea de Limbi Străine din București cu rezultate deosebite. Metodele mele sunt interactive, concentrându-se pe lexic, conversație, gramatică și ascultare. Am meditat atât copii, cât și adulți din toate domeniile (juriști, medici, corporatiști). Vă aștept pe toți cei interesați!','o ora','2023-06-12 22:06:05',80,'Bucuresti','Bucuresti','București','patru ani',1,1,1,18,0,NULL,NULL),(119,197,'Limba si literatura romana','Meditații limba și literatura română ','CURSURI ONLINE, via WhatsApp sau Google Meet. \r\nProfesor cu REZULTATE EXCEPȚIONALE - ofer evaluare inițială (maniera de studiu și de comunicare) și meditații/consultații la limba și literatura română. Sedințele de studiu se adresează atât celor care doresc să aprofundeze noțiunile deja învățate, cât și celor care au nevoie să recupereze informații. Sesiunile de meditații sunt interactive (fișe, mijloace audio, video) și au ca scop fixarea noțiunilor lingvistice într-o manieră facilă, logică și de lungă durată.\r\nPregătire elevi clasele V-VIII (inclusiv examen Evaluare Nationala) - 80 ron/ ședința de o oră;\r\n\r\nPregătire elevi examen de bacalaureat (clasa a XII-a) - 80 ron/ ședința de o oră;\r\n\r\nAdmitere la facultate (Filologie, Drept, Academia de Poliție etc.) - 150 ron/ ședința de o oră;\r\n\r\nConcurs admitere in magistratură/ Limba română pentru străini - 150 ron/ ședința de o oră\r\n\r\nRată de promovare - 100% SECTOR 4 / BUCURESTI  ','o ora','2023-11-21 19:08:01',80,'Bucuresti','Bucuresti','orice zona','mai mult de douazeci si cinci de ani',0,0,1,17,0,NULL,NULL),(120,197,'Limba franceza','Meditatii limba franceza','Cursuri online via WhatsApp sau Google MEET. Profesor cu experienta, ofer meditații limba franceză. Sedințele de studiu se adresează atât celor care doresc să aprofundeze noțiunile deja învățate, cât și celor care au nevoie să recupereze informații. Sesiunile de meditații sunt interactive (fișe, mijloace audio, video) și au ca scop fixarea noțiunilor lingvistice într-o manieră facilă, logică și de lungă durată. \r\n\r\nCLASE PRIMARE 60 ron/ ședința de o oră \r\n\r\nLICEU/FACULTATE/DELF/EXAMENE - 80 ron/ ședința de o oră\r\n\r\nTarifele sunt pentru lucrul individual.\r\nOFERTĂ SPECIALĂ!!! --- Pentru grupe de 3-5 elevi, tariful este negociabil ','o ora','2023-11-21 19:08:02',60,'Bucuresti','Bucuresti','Sector 4','mai mult de douazeci si cinci de ani',0,0,1,19,0,NULL,NULL),(121,197,'Alte materii','Scriere creativă ','CURSURI ONLINE, via WhatsApp sau Google Meet.\r\nScriere creativă - Cursul este un suport în elaborarea oricarui tip de lucrare literara, pentru obținerea eficacității în transmiterea ideilor și în redactarea eseurilor; modelează spre creativitate, spontaneitate, experiență și curiozitate, dezvoltare a intuiției și a imaginației personale; este, practic, un atelier de dezvoltare a creativității și a abilităților cognitive și afective ale participantilor.\r\nCursul este destinat tuturor celor care vor să-și dezvolte aptitudinile de exprimare curgătoare (în mod special în scris, dar nu numai!) si concentrată în idei.\r\nSedința 1 oră - 150 ron ','o ora','2023-11-21 19:08:04',150,'Bucuresti','Bucuresti','Sector 4','mai mult de douazeci si cinci de ani',0,0,1,20,0,NULL,NULL),(122,198,'Limba engleza','Meditații la limba engleză','Mă numesc Răzvan și sunt profesor de limba engleză, absolvent de masterat și licență la Facultatea de Litere, Universitatea din București.\r\nAm o experiență de cinci ani în lucrul cu elevii (meditații + experiența la catedră + voluntariat), dețin materiale de predare și lucru, bogate în activități interactive. Lucrez cu mulți copii, dar și cu adulți, reușind să obținem rezultate foarte bune într-un timp foarte scurt. Sunt pasionat de limba engleză încă de când eram copil și visul meu este să transmit mai departe această pasiune. Predarea se face într-un ritm care se mulează pe aptitudinile celui care studiază, în etape logice. Dețin atestatul de limbă engleză avansată CAE (nivelul C1) si atestatul FCE (nivelul B2). Am studiat și absolvit la facultate modulul psiho-pedagogic, astfel încat am căpătat cunoștințe și metode de predare eficientă și plăcută.\r\nGarantez, în primul rând o învățare serioasă, fără nelămuriri trecute cu vederea (nu înțelegem ceva, stăm cât se poate de mult și privim din mai multe unghiuri până înțelegem), iar, în al doilea rând, foarte multă răbdare. Ne vom structura materia în funcție de cerință și de capacitatea de învățare a elevului fără să pierdem din vedere în niciun moment cum se simte elevul și cum receptează informațiile. Promit că ora de engleză va deveni o plăcere, așa cum este și pentru mine.\r\nLucrez cu elevi de toate vârstele, de la gradiniță până la liceu, sau chiar și cu adulți care vor să-și perfecționeze cunoștințele sau să o ia de la zero. Pot lucra urmărind materia de la școală sau pot să pregatesc și pentru atestate Cambridge (Starters, Movers, Flyers, PET, FCE, CAE) bacalaureat sau admiterea la Școală generală/ Liceu intensiv/ bilingv, în funcție de preferința elevului și de dorința acestuia.\r\nAm mașină, mă pot deplasa la domiciliul elevului (cu costul de transport) sau putem lucra online. Pot spune că în unele cazuri, lucrul online a fost mult mai eficient.','o ora','2023-07-10 23:27:15',60,'Bucuresti','Bucuresti','Bucuresti - Ilfov','sase ani',1,1,1,19,0,NULL,NULL),(123,199,'Limba engleza','Engleza pentru orice nivel, Cambridge inclusiv','Profesor de Engleza cu 12 ani de experienta. Nivel de Engleza - Cambridge Proficiency C2. \r\n\r\nSunt o persoana rabdatoare, adaptabila si amuzanta si imi place sa imi adaptez orele in functie de nevoile elevului. \r\n\r\nEngleza online (7+ ani): 90 ron pe ora, 135 ron o ora si jumatate.\r\nEngleza online pentru examenele Cambridge, nivelele inalte (B2, C1, C2): 110 ron pe ora, 165 ron o ora si jumatate. \r\n\r\nSee you soon! \r\nAlex\r\nTel/WhatsApp: 0750645736\r\n','o ora','2023-06-20 01:00:04',90,'Bucuresti','Bucuresti','','cincisprezece ani',1,0,1,22,0,NULL,NULL),(124,200,'Limba engleza','Ofer meditatii la limba engleza','Ofer ore particulare de limba engleza începând cu nivelul A1 pâna la C2.\r\nÎn calitate de studenta la Facultatea de Litere, limbile straine sunt pasiunea mea. Având doi ani de experienta în acest domeniu, am reusit sa ajut numeroase persoane sa-si îmbunatateasca abilitatile lingvistice sau chiar sa învete de la zero. Lucrez cu toate categoriile de vârsta.\r\nO sedinta variaza între o ora si doua ore, în functie de necesitatile dumneavoastra, iar pretul este de 40 lei / h.','doua ore','2023-06-22 04:26:35',80,'Sibiu','Sibiu','Sibiu','doi ani',1,1,1,33,0,NULL,NULL),(125,200,'Limba germana','Ofer meditatii la limba germana','Ofer ore particulare de limba germana începând cu nivelul A.1.1 pâna la B2.2.\r\nÎn calitate de studenta la Facultatea de Litere, limbile straine sunt pasiunea mea. Având doi ani de experienta în acest domeniu, am reusit sa ajut numeroase persoane sa-si îmbunatateasca abilitatile lingvistice sau chiar sa învete de la zero. Lucrez cu toate categoriile de vârsta.\r\nO sedinta variaza între o ora si doua ore, în functie de necesitatile dumneavoastra, iar pretul este de 40 lei / h.','doua ore','2023-06-22 04:27:25',80,'Sibiu','Sibiu','Sibiu','doi ani',1,1,1,22,0,NULL,NULL),(126,203,'Matematica','Meditații matematică ','Ofer meditații la matematică elevilor din clasele gimnaziale. ','o ora si 30 minute','2023-08-27 06:03:11',120,'Mures','Targu Mures','oraș ','mai mult de douazeci si cinci de ani',1,1,1,25,0,NULL,NULL),(127,204,'Matematica','Meditatii la matematica online sau fizic pentru gimnaziu!','0747517199 pentru detalii intregi ','doua ore','2023-07-01 21:29:15',80,'Tulcea','Tulcea','intrare oras','un an',1,0,1,18,0,NULL,NULL),(129,206,'Limba franceza','Învățarea limbii franceze cu ușurință. ','Ofer meditații la limba franceza atât pentru cei mici de gradinita, cât și pentru elevii de clasele primare și gimnaziale.Imi place sa lucrez cu copii doritori sa învețe o limba străină și pun la dispoziție materiale educative și didactice specifice fiecărei vârste. Interacționez foarte ușor cu copiii și ma fac foarte repede plăcută de către ei, aspect ce ajuta foarte mult la interacționarea cu ei și asimilarea de cunoștințe iar ședințele de meditații devin plăcute și cei mici pot învața cu drag. ','o ora si 30 minute','2023-07-06 23:27:59',80,'Bucuresti','Bucuresti','Bucuresti','un an',0,0,1,20,0,NULL,NULL),(130,207,'Anatomie','Ofer meditatii la Anatomie','Studenta in anul VI, ofer meditatii la Anatomie, atat pentru examenul de Bacalaureat, cat si pt admitere. Am experienta de 5 ani in mentorat, elevi in centre precum Iasi, Bucuresti, Oradea, Cluj si imi place sa realizez o stransa relatie cu elevul. Am reusit sa iau nota 10 la Bacalaureat la Biologie si 9,90 la Admitere- biologie si chimie. ','o ora si 30 minute','2023-07-13 01:10:37',70,'Iasi','Iasi','','cinci ani',1,0,1,15,0,NULL,NULL),(131,207,'Chimie','Meditatii chimie pentru admitere si Bacalaureat','Studenta in anul VI, ofer meditatii la Chimie,atat pentru examenul de Bacalaureat, cat si pt admitere. Am experienta de 5 ani in mentorat, elevi in centre precum Iasi, Bucuresti, Oradea, Cluj si imi place sa realizez o stransa relatie cu elevul. 9,90 la Admitere- biologie si chimie, la biologie am primit 54/54 puncte.','o ora si 30 minute','2023-07-13 01:10:41',100,'Iasi','Iasi','','cinci ani',1,0,1,15,0,NULL,NULL),(132,207,'Biologie','Ofer meditatii biologie','Studenta in anul VI, ofer meditatii la Anatomie, atat pentru examenul de Bacalaureat, cat si pt admitere. Am experienta de 5 ani in mentorat, elevi in centre precum Iasi, Bucuresti, Oradea, Cluj si imi place sa realizez o stransa relatie cu elevul. Am reusit sa iau nota 10 la Bacalaureat la Biologie si 9,90 la Admitere- biologie si chimie.  ','o ora si 30 minute','2023-07-13 01:10:44',70,'Iasi','Iasi','','cinci ani',1,0,1,15,0,NULL,NULL),(133,208,'Limba engleza','English with a native speaker (USA)','I am a US native offering English lessons in Bucharest.\r\nI have been teaching for over 10 years, and have obtained a CELTA.\r\nI work with any age, any level, for any purpose. I have worked with actors, doctors, business people, children, and exam takers.\r\nI offer one free 90-minute demo lesson.\r\nAfter that:\r\n60 minutes: 80 RON\r\n90 minutes: 150 RON\r\n','o ora si 30 minute','2023-07-19 06:02:00',150,'Bucuresti','Bucuresti','','zece ani',1,0,1,13,0,NULL,NULL),(134,201,'Limba engleza','Engleza/Franceza Conversatie/Birou/Exam, Usor & Fun! si Traduceri','Prof 23ani/exp, Cursuri Engleza/Franceza/Rom, A1-C2, Usor&Fun!, pt Conversatie/Birou/Exam,FCE,IELTS,Delf, cu avans rapid conversatie si rezultate excelente din prima ora! Curs Individual Online/Grup/Romane Sherlock/Funny/Teme scoala/facultate,Conversatie Generala/Domenii,Interviu angajare/emigrare/avans job, Examene,CAE,CPE,Dalf,Bac,Litere,Limbi,Politie, fise lucru create de mine pt avans rapid gramatica/vocabular, fise cu teoria de baza si exercitii create pt fiecare cursant pt fixare gramatica de baza si vocabular, ajutor teme scoala/facultate la engleza/franceza/romana, compuneri/eseu/referate/lucrari/teme, traduceri pt facultate cursuri/seminarii, marire medii, teze, teste, pt aprofundare cunostinte/avansare profesionala, avans usor, rapid din prima ora si rezultate excelente! Profesor si traducator autorizat peste 23 ani vechime ofer Cursuri Individuale Online sau Grup 2-3 (rude, prieteni, colegi) elevi/clienti firme, bazate pe logica si simplitate, cu accent pe conversatie generala/pe domenii (birou, afaceri, financiar, comercial, economic, medical, IT, literar) si dialoguri foarte practice, vocabular (cuvinte/expresii/verbe frazale des intalnite), gramatica, lexic, scris/citit, pe toate intrebarile capcana din teste grila pt Politie si Limbi straine si pe toate intrebarile si raspunsurile standard de la orice interviu, dupa materiale proprii (romane Sherlock Holmes A1-C2 si manuale cu texte actuale: A Paris, Au restaurant, Au supermarché, teste noi grila pt Politie si Limbi straine, si grile si mici fise de lucru personalizate create de mine cu teorie de baza si exercitii pt fiecare cursant pt un avans rapid la gramatica si vocabular), de la 85-125 ron/1-1,30ore, de la 125-145/155ron 1,30/1,45-2ore si 55-75ron/30-50 minute pe Skype si alte platforme online, pretul variind in functie de durata, scop, nivel dorit, domeniul vizat, volumul de lucru pt a ajunge la nivelul dorit si frecventa, cu reduceri mai mari la 2-3 sedinte/saptamana si la 2-3 persoane. Lucrez de multi ani cu multi clienti de la firme multinationale pe diverse domenii pt conversatie, sedinte cu straini si avansare la job, pt examenele lor de nivel de la job, interviu sau plecari mereu cu un avans rapid la conversatie inca din primele ore si cu rezultate foarte bune. La cl I-IV am Magic English, 52 CD cu povesti Disney (Donald Duck, Mickey Mouse, Pisicile aristocrate, 101 Dalmatieni), cu jocuri,cantecele si reviste amuzante de completat si colorat, o engleza amuzanta prin joaca si la cl V-VI Welcome 1, 2, o carte amuzanta cu aventurile unor copii veseli si un duh foarte vesel care ii insoteste si ii ajuta peste tot. La franceza la cl I-IV am povesti online amuzante cu desene, cu Zebulon, un mic print lenes, cu Martial, un mic extraterestru spion intr-o scoala de la noi, si cu aventurile unor animalute care tot merg vesele prin Franta si cu copii veseli si amuzanti din manuale de lectura foarte actuale din Franta si Belgia cu cuvinte si expresii noi foarte uzuale, des intalnite. Traduc si corectez compuneri, eseu, rezumate, referate, articole, teme pt scoala/facultate in/din engleza/franceza/romana, orice nivel/domeniu (acte, CV, documente) rapid si eficient, de la 25-40/45 ron/1 pagina, dupa domeniul si gradul de dificultate. Va astept cu drag la studiu la Piata 1 Mai intr-o atmosfera foarte relaxata si placuta!                        ','o ora si 30 minute','2023-11-23 05:19:55',85,'Bucuresti','Bucuresti','','douazeci de ani',1,0,0,37,0,NULL,NULL),(135,201,'Limba franceza','Franceza/Engleza pt Conversatie/Birou/Exam, Usor & Fun! si Traduceri','Prof 23ani/exp, Cursuri Franceza/Engleza/Rom, A1-C2, Usor&Fun!, pt Conversatie/Birou/Exam,FCE,IELTS,Delf cu avans rapid conversatie si rezultate excelente din prima ora! Curs Individual Online/Grup/Romane Sherlock/Funny/Teme scoala/facultate,Conversatie Generala/Domenii,Interviu angajare/emigrare/avans job, Examene,CAE,CPE,Dalf,Bac,Litere,Limbi,Politie, fise lucru create de mine pt avans rapid gramatica/vocabular, fise cu teoria de baza si exercitii create pt fiecare cursant pt fixare gramatica de baza si vocabular, ajutor teme scoala/facultate la