ente, concursuri. Felul in care are loc predarea va fi si in functie de elev, de energia, cunostintele, scopul sau, insa cu rabdare si intr-un ritm potrivit fiecaruia. Materialele de lucru (fise, variate, sinteze) le asigur eu. Daca este nevoie, vom lua totul de la inceput, incusiv operatiile de baza din clasele 4-8. Sedintele au loc in apropiere de Piata Romana, individual sau in grup (daca exista elevi compatibili ca si cunostinte, ritm de invatare, program etc). La sedintele in grup pretul este cu 50% mai mic. Promovabilitatea elevilor mei este de 100 % anul acesta, marea majoritate a notelor fiind in jurul lui 9 si 10.','doua ore','2023-07-29 01:41:58',120,'Bucuresti','Bucuresti','Piata Romana, Universitate','noua ani',0,0,1,11,0,NULL,NULL),(138,209,'Fizica','Meditatii la fizica pentru bacalaureat si admitere','Profesor si meditator cu peste 9 ani de experienta la stat si in pregatirea particulara a elevilor, pregatesc elevii din clasele 5-12 pentru evaluarea nationala, bacalaureat si admiterea la facultate, precum si pentru intelegerea materiei predate la clasa. Promovabilitatea elevilor mei a fost de 100%.Daca este nevoie (cel mai des este), luam totul de la inceput, fara mai multa graba decat este necesar. Pentru cei ce au unee baze, vom incerca sa explicam fie totul logic, pentru a evita memorarea mecanica, fie prin tipuri de exercitii invatate prin repetare, fie mixt. Promovabilitatea celor peste 30 elevi pregatiti anul acesta a fost de 100%. Materialele de lucru (fise, teste, sinteze) le voi asigura eu. Pregatesc si elevii de anul 1 la ASE. Pregatirile au loc in apropiere de Piata Universitatii, fie individual, fie in grup, durand doua ore. Pretul variaza intre 120 lei/2 ore (individual), sau 80 lei/2 ore (grup). ','doua ore','2023-07-29 01:42:04',120,'Bucuresti','Bucuresti','Bucuresti','noua ani',0,0,1,16,0,NULL,NULL),(139,210,'Fizica','Meditatii Fizica','\r\nVă aflați în căutarea unui meditator? Parcursul scolii de pilotaj și pasiunea pe care am avut-o pentru fizica în liceu, împreună cu numeroase participări la olimpiadele județene, m-au ajutat să îmi îmbunătățesc abilitățile de tutore. Având cunoștințe vaste de fizică și matematică vă ofer o perspectivă diferită asupra procesului de învățare, împreună descoperind cu răbdare și empatie, faptul că fizica este o materie atât de interesantă și utilă, care se regăsește în viața de zi cu zi.','o ora','2023-07-28 00:10:01',80,'Bucuresti','Bucuresti','','cinci ani',1,0,1,13,0,NULL,NULL),(140,210,'Matematica','Meditatii Matematica','\r\nVă aflați în căutarea unui meditator? Parcursul scolii de pilotaj și pasiunea pe care am avut-o pentru matematica în liceu, împreună cu numeroase concursuri și nota 9.65 obținută la BAC, m-au ajutat să îmi îmbunătățesc abilitățile de tutore. Având cunoștințe vaste de fizică și matematică vă ofer o perspectivă diferită asupra procesului de învățare, împreună descoperind cu răbdare și empatie, faptul că matematica este mai mult decât o materie care îți dă bătăi de cap.','o ora','2023-07-28 00:10:53',80,'Bucuresti','Bucuresti','','cinci ani',1,0,1,14,0,NULL,NULL),(141,210,'Limba engleza','Pregatire Cambridge/TOEFL','Vă aflați în căutarea unui meditator? Datorită experienței de pilot și a studiilor efectuate în limba engleză, vă pot ajuta și susține în îndeplinirea obiectivelor dumneavoastră atât pentru examenele de tip Cambridge, TOEFL cât și pentru îmbunătățirea cunoștințelor și abilităților de a comunica în limba engleză. \r\n- Certificat TOEFL - 110/120\r\n- ICAO Aviation ELP - Level 5\r\n- Certificat Cambridge - B2','o ora','2023-07-28 00:11:46',100,'Bucuresti','Bucuresti','','cinci ani',1,0,1,16,0,NULL,NULL),(142,212,'Biologie','Meditatii biologie','Studentă în anul întâi la Facultatea de Medicină și Farmacie „Victor Babeș” din Timișoara ofer meditații la biologie pentru examenul de bacalaureat. Meditațiile se pot desfășura atât online cât și la domiciliul personal, iar materia cuprinde anatomia învățată în clasele 11-12. Materialele utilizate sunt bine structurate și foarte ușor de învățat + culegere cu toate variantele examenului de bacalaureat din anul 2011 până în prezent (carte ce va trebui parcursă și lucrată). Ședinta va fi de câte 2 ore și chiar mai mult dacă este cazul iar prețul este de 70 de lei. Pentru mai multe întrebări vă rog să mă contactați în privat!','doua ore','2023-07-28 23:39:57',70,'Timis','Timisoara','Zona lipovei','un an',0,0,1,15,0,NULL,NULL),(143,213,'Matematica','Meditatii la matematica pentru bacalaureat si admitere la facultate','Sunt profesor de matematică și am o îndelungată carieră didactică. Am gradul didactic I, am predat la liceu, atât teoretic - matematică-informatică dar și industrial - tehnologic și cunosc elevii din ambele tipuri de școli. Pregătesc de o viață elevi pentru activitatea curentă la școală, pentru lucrări sau teze dar mai ales pentru examenele de bacalaureat și admitere la facultate. Meditațiile se desfășoară individual, cu explicații, prezentări teoretice și rezolvări de probleme pe interesul oricărui elev și în ritmul propriu al fiecăruia. Pentru mai multe informații vă aștept pe pagina mea web https://mircea-colie.ro/ sau puteți să-mi scrieți la adresa: meditatii@mircea-colie.ro sau la telefon 0775265442. Vă aștept cu drag! ','o ora si 30 minute','2023-08-03 21:18:08',100,'Bucuresti','Bucuresti','','mai mult de douazeci si cinci de ani',1,0,0,12,0,NULL,NULL),(144,214,'Chimie','Pregatire chimie organica si anorganica ','Absolventa a facultatii de medicina \"Victor Papilian\" Sibiu si al Modulului Psihopedagogic din cadrul facultatii de psihologie Sibiu ,ofer meditatii la chimie organica ( clasele X si XI ) si anorganica , pregatire pentru examenul de bacalaureat cat si pentru admiterea la facultatiile de profil (medicina, AMG , medicina dentara , farmacie ) din centrele universitare din tara.\r\nDe asemenea , ofer meditatii si la matematica , gimnaziu si pregatire pentru bacalaureat. \r\n-pregătire intensivă în vederea susținerii examenului de Evaluare Națională chiar si pentru admiterea la liceele cu profil stiintele naturii/matematica-informatica;\r\n-pregătire intensivă în vederea susținerii examenului de Bacalaureat, indiferent de profil ;\r\n-recuperare materie și sprijin în pregătire pentru orice formă de evaluare inclusiv cele de corigenta , conform programei școlare actualizate la zi. \r\nPlanul de studiu, precum și modul de rezolvare al grilelor sunt însoțite de explicații cu exemple clare din practică pentru a înțelege logic problemele de chimie organica, anorganica si matematica. Țin legătura în permanent cu elevii mei și le ofer explicații oricând au nevoie, simțind astfel un sprijin chiar și în afara ședințelor de pregătire.\r\nAm inceput sa ofer meditatii din anul 2020.\r\nAm pregatit elevi pentru examenul de corigenta , pentru evaluarea nationala, pentru examenul de Bacalaureat si pentru Admiterea in invatamantul superior. \r\nSuportul didatic va fi oferit inaintea orelor de pregatire, astfel incat sa ne bazam pe aplicarea acesteia. \r\nSedintele se pot efectua online, la domiciliu si la domiciliul elevului. \r\nOrele se pot desfasura atat individual , cat si in grupe/semigrupe. ','o ora si 30 minute','2023-08-27 19:35:19',80,'Brasov','Brasov','Brasov','trei ani',1,1,1,16,0,NULL,NULL),(145,215,'Economie','Meditatii ECONOMIE','Profesoara cu experienta ofer meditatii profesioniste pentru bacalaureat si admitere (Drept, SNSPA) - sistematizare materie - explicare amanuntita - probleme - grile - variante - fise pentru studiu individual. \r\nAm rabdare si fac cu placere acest lucru. \r\nProgres imediat garantat.\r\n\r\n','o ora si 30 minute','2023-08-11 04:54:51',120,'Bucuresti','Bucuresti','sector 5','douazeci de ani',1,0,1,20,0,NULL,NULL),(147,217,'Matematica','Matematica individual','Meditez individual elevi cls. 8-12, pentru bac, testare nationala sau pentru anul in curs, dupa un plan de lectii bine stabilit si particularizat pe elev.','doua ore','2023-08-14 06:10:56',150,'Bucuresti','Bucures