/2h; pentru Evaluare Nationala: 110 lei/2h; pentru clasele 9-12: 120 lei/2h; pentru Bacalaureat si admiterea la facultate: 130 lei/2h; pentru studenti: 150 lei/2h ','doua ore','2023-08-28 02:59:51',120,'Dolj','Craiova','Centrala','mai mult de douazeci si cinci de ani',1,0,1,14,0,NULL,NULL),(154,220,'Fizica','Meditatii fizica orice nivel','Fac MEDITAȚII/CONSULTATII/TEME la MATEMATICĂ și FIZICĂ online si la domiciliul meu, pentru clasele I – XII, bacalaureat, admitere facultate și facultate de peste 25 ani și cu reușite 100% la școală, examene și la nivel personal.\r\n\r\nOricine poate avea rezultate remarcabile dacă se pregătește prin intermediul PROGRAMULUI PROPRIU PregaTESTE-Te INTELiGENTle!\r\n\r\nGarantez că rezultatele bune încep să apară chiar după primele ședințe.\r\n\r\nIn afara de continutul gratuit pentru matematica si fizica, puteti avea in orice moment acces la continutul premium pentru matematica si fizica.\r\n\r\nPentru cele mai bune PERFORMANȚE,\r\n\r\nVĂ AȘTEPT CU DRAG!\r\nhttps://meditatiimatefizica.wordpress.com/\r\nPentru clasele1-4: 80 lei/2h; pentru clasele 5-7: 90 lei/2h; pentru Evaluare Nationala: 110 lei/2h; pentru clasele 9-11: 120 lei/2h; pentru Bacalaureat si admiterea la facultate: 130 lei/2h; pentru studenti: 150 lei/2h','doua ore','2023-08-28 03:00:47',120,'Dolj','Craiova','Centrala','mai mult de douazeci si cinci de ani',1,0,1,11,0,NULL,NULL),(155,222,'Limba engleza','Ofer meditatii la limba engleza','Profesoara cu experienta, ofer meditatii la limba engleza pentru irice nivel, inclusiv examene de admitere, scoala de politie si BAC. Cer si ofer seriozitate! ','o ora','2023-11-15 20:46:33',100,'Suceava','Suceava','Obcini','zece ani',1,0,1,17,0,NULL,NULL),(156,223,'Limba si literatura romana','Meditatii Limba și Literatura Română- Bacalaureat ','Ofer meditații elevilor care anul acesta vor susține examenul de Bacalaureat la proba de Limba și Literatura română. Am absolvit Facultatea de Litere din cadul Universității din București și în prezent urmez programul de masterat tot din cadrul Facultății de Litere, parcurgând în același timp și modulul psihopedagogic. (Modul I- absolvit; Modul II-în curs)\r\nLa rândul meu, nota obținută în Bacalaureat la proba de Limba și Literatura Română, a fost 10.\r\nVom discuta si vom gândi impreună! Stilul de predare va fi decis împreună cu elevul în funcție de preferințele, obiectivele și modul de învățare al acestuia.\r\nDispun de materiale interactive și sistematizate, care vor face învâțatul cât mai plăcut. :)\r\nPentru mai multe detalii, nu ezitați să mă contactați. ','doua ore','2023-09-02 23:04:19',70,'Bucuresti','Bucuresti','Sector 2','cinci ani',1,0,1,11,0,NULL,NULL),(157,131,'Matematica','Matematica pe intelesul elevului','Ofer meditatii matematica cls 3-8, Capacitate. Sunt un profesor daruit cu rabdare si entuziasm pt materia ce o predau  Imi place sa lucrez cu adolescentii aflati intr o etapa de viata caracterizata de curiozitate si cautare de sine. Am convingerea ca formulele din matematica , odata asimilate teoretic ,pot fi aplicate in probleme de diverse grade de dificultate. In asta si consta esenta pregatirii particulare. Lucram impreuna motivatia si increderea in sine. Rezultate dupa a 3a sedinta. Va astept cu drag la pregatire!','o ora si 30 minute','2023-11-01 16:06:21',100,'Bucuresti','Bucuresti','Pta Muncii','mai mult de douazeci si cinci de ani',0,0,1,11,0,NULL,NULL),(158,224,'Limba franceza','Cursuri Meditatii limba Franceza pentru copii si adulti','Trainer autorizat, profesor certificat, meditator, traducator si interpret ofer:\r\nCursuri/Meditații individuale personalizate pentru copii și adulți\r\n\r\nLimba Franceză\r\nLimba Engleză\r\nLimba Spaniolă/Catalană\r\nLimba Română\r\n\r\nPregătire Examene, Cambridge KET, PET, FCE, CAE, IELTS, DELF/DALF, DELE, Engleza de afaceri, Franceza de afaceri, examen competente BAC, admitere învățământ superior\r\nTraduceri, Interpretariat, Revizii\r\nAjutor teme/Examene\r\n\r\nPlatforme disponibile: Zoom, Teams, Skype\r\n\r\nPreturi cursuri:\r\nÎncepând cu:\r\n90ron 1hsi30min\r\n140ron/2h\r\n(inclusiv online) - nivel A0, A1 începător\r\n\r\nPentru mai multe informații și înscrieri: 0750713349\r\n\r\nDespre cursuri: Rezultate vizibile încă din primele sedințe datorită unui program de lucru interactiv și personalizat în funcție de cerințele fiecărui elev și de modul de învățare al acestuia. \r\n\r\nGrupe noi disponibile de nivel A1 incepator\r\n\r\nZona Bucuresti Sector 6','o ora si 30 minute','2023-09-04 01:18:09',90,'Bucuresti','Bucuresti','','cincisprezece ani',1,1,1,10,0,NULL,NULL),(159,224,'Limba engleza','Cursuri Meditatii limba Engleza pentru copii si adulti','Trainer autorizat, profesor certificat, meditator, traducator si interpret ofer:\r\nCursuri/Meditații individuale personalizate pentru copii și adulți\r\n\r\nLimba Engleză\r\nLimba Franceză\r\nLimba Spaniolă/Catalană\r\nLimba Română\r\n\r\n️Ajutor teme\r\n️Pregătire Examene, Cambridge YLE, KET, PET, FCE, CAE, IELTS, Engleza de afaceri, examen competente BAC, admitere învățământ superior.\r\n\r\nPlatforme disponibile: Zoom, Teams, Skype\r\n\r\nHi! I am a professional translator, authorized trainer, tutor and TEFL (Teaching English AS FOREIGN LANGUAGE) certified teacher and I teach English courses/ private lessons to children, teenagers and adults by adapting to the needs of my students.(it is also possible to teach in groups of 2 or more students) . With many years of experience and new methods. If you are interested call me. THANKS.\r\n\r\nCosturi per elev\r\nÎncepând cu:\r\n90RON-ședința de 1hși30min/140RON-2H\r\n\r\nOrice nivel\r\n100% seriozitate\r\n\r\nGrupe noi disponibile de nivel A1 incepator.\r\n\r\nPentru detalii si programari ma puteti contacta la telefon 0750713349.\r\nZona Bucuresti Sector 6','o ora si 30 minute','2023-09-04 01:20:54',90,'Bucuresti','Bucuresti','','cincisprezece ani',1,1,1,11,0,NULL,NULL),(160,224,'Limba spaniola','Cursuri Meditatii limba Spaniola Catalana pentru copii si adulti','Trainer autorizat, profesor certificat, meditator, traducator si interpret ofer:\r\nCursuri/Meditații individuale personalizate pentru copii și adulți\r\n\r\nLimba Spaniolă/Catalană\r\nLimba Engleză\r\nLimba Franceză\r\nLimba Română\r\n\r\nAjutor teme/Examene\r\nPlatforme disponibile: Zoom, Teams, Skype\r\n\r\nPreturi cursuri:\r\nÎncepând cu:\r\n100ron 1hsi30min\r\n140ron/2h\r\n(inclusiv online) - nivel A0, A1 începător\r\n\r\n¡Hola! Soy maestra de español y doy clases de español /cursos para niños, adolescentes y adultos al mismo tiempo adaptándome a las necesidades de mis alumnos. (Posibilidad de grupos 2 o más alumnos). Con más de 10 años experiencia y métodos nuevos. Si estás interesado escribe un mensaje en privado o hazme una llamada telefónica. Gracias\r\n\r\nDespre cursuri: Rezultate vizibile încă din primele sedințe datorită unui program de lucru interactiv și personalizat în funcție de cerințele fiecărui elev și de modul de învățare al acestuia.\r\n\r\nGrupe noi disponibile de nivel A1 incepator. \r\n\r\nPentru mai multe informații și înscrieri ma puteti contacta la numarul de telefon: 0750713349\r\n\r\nZona Bucuresti Sector 6\r\n\r\nOfer meditatii la limba Română, Engleză, Franceză, Spaniolă/Catalană.','o ora si 30 minute','2023-09-04 01:23:11',100,'Bucuresti','Bucuresti','','cincisprezece ani',1,1,1,27,0,NULL,NULL),(161,224,'Limba si literatura romana','Cursuri Meditatii limba Romana pentru copii si adulti','Meditații individuale limba română orice nivel\r\n️Gramatică/ajutor teme/Examene\r\n\r\nLimba română pentru străini.\r\n\r\nTrainer autorizat, profesor certificat, meditator, traducator si interpret ofer:\r\nCursuri/Meditații individuale personalizate pentru copii și adulți\r\n\r\nLimba Română\r\nLimba Engleză\r\nLimba Franceză\r\nLimba Spaniolă/Catalană\r\n\r\nAjutor teme/Examene\r\n\r\nPreturi cursuri:\r\nÎncepând cu:\r\n90ron 1hsi30min\r\n140ron/2h\r\n\r\nPentru mai multe informații și înscrieri ma puteti contacta la: 0750713349\r\n\r\nDespre cursuri: Rezultate vizibile încă din primele sedințe datorită unui program de lucru interactiv și personalizat în funcție de cerințele fiecărui elev și de modul de învățare al acestuia.\r\n\r\nZona Bucuresti Sector 6','o ora si 30 minute','2023-09-04 01:24:16',90,'Bucuresti','Bucuresti','','cincisprezece ani',1,1,1,10,0,NULL,NULL),(162,226,'Chimie','Meditații chimie','Ofer meditații la chimie organică pentru admiterea la UMF.\r\nAdopt metode atât clasice cât și moderne, individualizate, adaptate fiecărui elev în parte.\r\nMa axez pe invatare logica,munca susținută si, mai ales,seriozitate și astfel,rezultatele nu întârzie să apară.\r\nȘedințele de meditații includ predarea integrală a materiei și aplicarea acesteia în rezolvarea grilelor. Materialele cu care vom lucra sunt atât cele prevăzute în tematica pentru admitere, cât și materiale proprii ajutătoare.\r\nSedintele se desfasoara in regim online pentru o durata de 2 ore.\r\nZiua si ora sunt stabilite de comun acord,in functie de programul meu si al elevului.\r\nOfer și cer seriozitate!\r\nPentru mai multe detalii,mă puteți contacta la numărul de telefon afișat sau pe WhatsApp.','doua ore','2023-09-06 21:35:17',100,'Bucuresti','Bucuresti','','cinci ani',1,0,1,11,0,NULL,NULL),(163,227,'Limba si literatura romana','Meditatii Limba și literatura română - E.N/ Bacalaureat','Ofer meditații la Limba și literatura română/ Limba Franceză.   \r\n\r\nFiecare copil este sprijinit să-și descopere propriul stil de învățare, pentru a face din provocările educaționale adevărate reușite, iar metodele de predare folosite sunt unele moderne, pliate pe nevoile fiecărui învățăcel, indiferent de vârsta acestuia. ','doua ore','2023-10-23 22:06:09',100,'Bucuresti','Bucuresti','Sector 4','sase ani',1,0,1,18,0,NULL,NULL),(164,228,'Limba engleza','Profesor limba engleza si traducator autorizat','Profesor limba engleza si traducator autorizat, cu experienta ca si meditator de peste 15 ani, ofer meditatii la Limba Engleza orice nivel, clasele 0-XII, in vederea \r\nconsolidarii cunostintelor de gramatica, limbaj standard, conversatie pentru incepatori (si nu numai).\r\nDeasemenea, am experienta si in pregatirea elevilor in vederea  sustinerii examenelor Cambridge.\r\nMetodele de predare sunt moderne, adaptate pentru fiecare elev in parte si avand ca scop dezvoltarea celor patru abilitati necesare studiului unei limbi straine. \r\nRezultate vizibile datorita unui program de lucru interactiv si al unui plan de lucru individual, in functie de varsta, cerintele si capacitatile fiecarei persoane in parte, punand la dispozitie diverse materiale didactice utile.\r\nSedintele se desfasoara la domiciliul meu (Sector 4, soseaua Vitan Barzesti- zona IRA) \r\nPret 1h- 70lei\r\nPret 1h30- 100 lei\r\nPret 2h- 120 lei','doua ore','2023-09-06 08:48:41',120,'Bucuresti','Bucuresti','Sos. Vitan Barzesti (Zona RIN)','cincisprezece ani',1,0,1,16,0,NULL,NULL),(165,229,'Programare','Pregătire informatică / programare','Ofer pregatire de orice nivel pentru elevi/studenti sau doritori in a intra in industria IT.\r\n\r\nExpertiza in programare web(backend, frontend), scripting, baze de date, machine learning introductiv.\r\n\r\nTehnologii folosite: Java, Python, SQL, NoSQL, Linux, Spring, Hibernate, Kafka.\r\n\r\nProfil Linkedin: https://www.linkedin.com/in/virgil-baldovin-5202ba183  ','o ora si 30 minute','2023-09-06 09:25:29',200,'Bucuresti','Bucuresti','','sase ani',1,0,0,17,0,NULL,NULL),(166,230,'Biologie','Pregatire admitere UMFCD - medicina Bucuresti','Te-ai hotarat sa dai la medicina in Bucuresti si nu stii de unde sa incepi? Manualul pare subtire, insa nu te lasa pacalit. \r\n\r\nSunt studenta in IV la Universitatea de Medicina si Farmacie Carol Davila din Bucuresti, si sunt pregatita sa iti arat toate detaliile ce stau in spatele unei reusite la admitere. Incepem de la la organizarea precisa a materiei si ajungem pana la grilele formulate din cele mai ascunse colturi ale Corintului. \r\n\r\nAm trecut si eu prin asta, intrand cu 90 de puncte la buget in primul an si continuand cu bursa in timpul facultatii. Iti voi explica materia de cate ori este nevoie, utilizandu-ma de toate resursele necesare, iar stilul predarii va fi adaptat nevoilor tale. \r\n\r\nSedintele de meditatii incep printr-un scurt test de recapitulare a materiei predate cu o saptamana in urma, ca tu sa iti revizui progresul pe parcursul anului si sa revenim pe capitolele necesare. Trecerile prin manual vor fi numeroase, indiferent de timpul de care dispui. Voi structura materia astfel incat sa poti ajunge sa asociezi notiunile din diferite capitole, sa poti raspunde la grile complexe. \r\n\r\n Materiale: \r\n-  toate culegerile de grile din 2008 pana in prezent \r\n-  grile realizate de profesori universitari\r\n-  scheme, rezumate ale materiei \r\n-  grilele de la  admiteri si simulari 2008- prezent \r\n-  acces pe plaforma  Anatomy 3D pentru o vedere in spatiu a anatomiei corpului\r\n-  Netter - atlas de anatomie, Boron - atlas de fiziologie\r\n\r\nLocuiesc in sector 6, zona Lujerului. Pregatirea pentru admitere poate avea loc atat fizic, cat si online si dureaza 1 ora si 30 min - 2 ore si 30 min in functie de capacitatea ta de concentrare si de capitolul predat.','doua ore','2023-09-07 22:48:40',100,'Bucuresti','Bucuresti','Lujerului, Sector 6, Bucuresti','doi ani',1,1,1,12,0,NULL,NULL),(167,231,'Limba germana','Invata germana online cu profesor nativ! ','Centrul nostru ofera cursuri de germana online pentru incepatori, intermediari si avansati. Sedintele sunt de grup sau individual, clasice sau intensive.  Oferim si cursuri 1 la 1.\r\nMai multe informatii pe www.germankulturhaus.ro\r\nPreturi avantajoase, de la 495 lei pe luna pentru grupuri de maxim 9 persoane. Cere detalii.\r\n','doua ore','2023-09-09 00:18:00',100,'Bucuresti','Bucuresti','online','zece ani',0,0,1,14,0,NULL,NULL),(168,232,'Biologie','Meditatii biologie bac/admitere','Durată: 2h\r\nPreț: 100 lei\r\nMetodă: online \r\nDragă viitorule student,\r\nMă numesc Roxana și sunt studentă în anul V la Facultatea de Medicină din cadrul UMF Carol Davila, București. Împărtășesc o reală afinitate față de studiul științelor naturii, iar tocmai din acest motiv consider că pot prilejui accesul doritorilor către studiul medicinei.\r\nÎn acest sens, ofer pregătiri la biologie (materia din clasele XI-XII) pentru cei care urmează să dea Bacalaureatul, dar și pentru cei care vor să participe la concursul de admitere la facultățile de Medicină, Medicină Dentară, Medicină Veterinară, Farmacie, Kinetoterapie. \r\nScopul meu este de a te învăța cum să înveți, de a-ți explica materia în detaliu, dar și într-o manieră circumscrisă modalității tale de studiu, precum și de a te familiariza cu subiectele de la examenele de admitere.\r\nTe poți întreba, bunăoară, cum vor decurge orele de pregătire?\r\nEi bine, îți propun ca în prima ședință să ne cunoaștem, să evaluăm nivelul de la care pornim, precum și să discutăm strategia pe care o vom adopta pe parcursul itinerariului nostru educațional.\r\nUlterior, vom parcurge materia, așa cum este în tematică, ajutându-ne de scheme, imagini, filmulețe. Fiecare ședință va debuta cu o scurtă recapitulare a lecțiilor parcurse anterior, astfel încât materia să fie constant parcursă și să devină aproape imposibil de uitat. Evident, în planul nostru individualizat, vom lucra și simulări pentru bac/teste grilă pentru admitere, în funcție de centrul universitar în care îți dorești să aplici.\r\nDacă îți propui să ai rezultate excelente și să lucrezi într-o manieră prietenoasă și comodă, nu ezita să mă contactezi! Hai să ne bucurăm împreună de reușită!','doua ore','2023-09-12 19:08:16',100,'Bucuresti','Bucuresti','','doi ani',1,0,1,8,0,NULL,NULL),(170,238,'Biologie','Biologie pentru admitere la Medicină ','Sunt medic, am absolvit UMF Carol Davila în anul 2003 și te pot ajuta sa îți îndeplinești și tu visul de a deveni medic.\r\nMai multe despre mine găsești pe Facebook și Insta: Biologie pentru Medicină ','doua ore','2023-09-21 23:29:29',1,'Bucuresti','Bucuresti','Sector 6, Drumul Sării','douazeci de ani',1,0,1,8,0,NULL,NULL),(171,239,'Matematica','Matematica simplificata','Absolventa a Facultatatii de Inginerie Aerospatiala (Univeritatii Polithenica Bucuresti), sectia Echipamente si Instalatii de Aviatie, ofer meditatii pentru clasele I-VIII si IX-XII online sau la domiciliul meu (in apropiere de Piata Victoriei)\r\n\r\nPregatesc elevi la matematica (I-XII) și la fizica (clasele IX-X: optică, mecanică, electricitate, termodinamica) pentru recuperarea materiei, consolidarea cunostintelor, Evaluarea Nationala, Bacalaureat (M1, M2, M3), examene de admitere. Sunt o persoana serioasa, calma, rabdatoare, imi place foarte mult sa ajut si sa lucrez cu copiii de toate varstele. *Anunt disponibil si in timpul vacantelor*    ','doua ore','2023-11-06 07:49:40',100,'Bucuresti','Bucuresti','Piata Victoriei ','sase ani',1,0,1,17,0,NULL,NULL),(172,225,'Matematica','Meditatii matematica si dezvoltare personala','Ofer meditatii la matematica, ajutor la teme si dezvoltare personala (clasele 0-7, elevi cu dificultati de invatare).','doua ore','2023-09-19 03:45:22',60,'Bacau','Bacau','Tic-Tac','trei ani',0,0,1,6,0,NULL,NULL),(173,240,'Biologie','Meditatii biologie admitere facultate ','Ofer meditatii la biologie pentru admitere la Facultatea de Medicina generala, dentara, farmacie, medicina veterinara si bac (clasele XI si XII). Am fost admisa la facultate pe locuri bugetate, obtinand 93 de puncte (58/60 la biologie), precum si premii la olimpiada de biologie, faza nationala din clasa a 7-a pana in clasa a 11-a. In vederea aprofundarii materiei pun la dispozitie: - scheme si planse - documente separate cu detalii din manual - grilele date la admitere din 2007 pana in prezent - acces pe platforma Anatomy 3D, pentru o intelegere mai buna a notiunilor de anatomie - teste cu grade diferite de dificultate (usor, mediu, greu) - culegerile de grile editura Carol Davila in format pdf din 2008 pana in prezent - alte culegeri de grile pentru fixarea cunostiintelor. In cadrul unei sedinte va fi explicata materia, iar la final se da un test din lectia precedenta. Va exista un anumit nr de grile care trebuie facute de la o sedinta la alta si ulterior discutate nelamuririle. Pentru alte intrebari, ma puteti oricand contacta :)','doua ore','2023-09-19 04:01:48',100,'Bucuresti','Bucuresti','Gorjului','trei ani',1,0,1,4,0,NULL,NULL),(174,242,'Fizica','Meditatii Fizica - Gimnaziu/Liceu/Bacalaureat','Ofer meditatii la fizica pentru gimnaziu, liceu si pregatire bacalaureat.\r\nSedintele se pot defasura fata in fata sau online.\r\nExperienta profesionala in domeniul didactic am capatat-o dupa ocuparea unui post de profesor de fizica la o socala gimnaziala si a unui post de asistent universitar in cadrul departamentului de fizica al Universitatii Politehnica din Bucuresti.','doua ore','2023-09-21 04:38:39',150,'Bucuresti','Bucuresti','Sector 6','cinci ani',1,1,1,7,0,NULL,NULL),(175,243,'Limba spaniola','Pregătire la examenelor internaționale de SPANIOLĂ ',' Ședințele se efectuează pe zoom sau google meet, cu durată de 1h (mai mult decât suficient).\r\nLa oră se lucrează atât vocabular cât și gramatică, se citește texte adaptate vârstei și nivelul. De asemenea pun accent pe audio îmbinate cu lectură pentru a sporii atenția.  La sfârșitul ședinței se pun temele și le aștept pe whataspp (poza) scrise pe caiet următoarea ședință. Aceste sunt importate, ce puteți face în masura timpului dvs.\r\n\r\nLucram fără stres și fără să alergăm, într-o formă dinamică și plăcută dar să rămânem cu noțiunile importante. \r\n\r\nDisponibilitate mea este flexibila momentan, putem stabili în funcție de Orarul fiecărui.  \r\nȘedințele rezervate și neefectuate se plătesc. Rog să fiu anunțată cu minim 8h înainte. \r\n\r\nVă las și tariful:\r\n\r\nPersona fizică:\r\n100 lei -1h spaniolă generală \r\n120 lei -1h pregătire DELE A1, A2/B1\r\n130lei-1h-Dele B1, B2, C1, C2\r\n140 lei-1h-limbaj specializat (juridic,  medical, turism)\r\n\r\nPers.juridică:\r\n120 lei-1h- spaniolă generală \r\n140lei-1h pregătire DELE A1, A2/B1\r\n150lei-1h- Dele B1, B2, C1, C2\r\n160 lei-1h-limbaj specializat (juridic,  medical, turism)\r\nSe poate plătii pe lună, cu factură pentru mai multe ședințe efectuate sau pe Revolut după fiecare ședință. Cum doriți dvs.\r\nVă stau la dispoziție pentru orice alte detalii.','o ora','2023-09-24 06:54:52',120,'Bucuresti','Bucuresti','','sase ani',1,0,1,13,0,NULL,NULL),(176,245,'Matematica','Profesoara de matematica meditez','Profesoara de matematica meditez eficient si cu rabdare matematica orice nivel. Succesul la toate examenele este garantat.','doua ore','2023-09-26 05:21:24',150,'Cluj','Cluj-Napoca','Marasti, Bulgaria','douazeci de ani',0,0,1,13,0,NULL,NULL),(177,247,'Istorie','Meditatii Istorie','Buna! Ofer meditatii la istorie elevilor de liceu care se pregatesc pentru examenul de BAC. Pregatirea are ca scop intelegerea cursului istoric prin povestirea dar si schematizarea lectiilor din fiecare capitol, folosind metoda care pe mine m-a ajutat sa obtin nota 10 la bacalaureat in sesiunea iunie-iulie 2023.','o ora','2023-10-08 00:11:54',50,'Bucuresti','Bucuresti','','mai putin de un an',1,0,1,7,0,NULL,NULL),(178,247,'Limba engleza','Meditatii Engleza','Bună! Ofer meditații la limba engleză pentru elevii din clasele primare, gimnaziu, dar si liceu. Am absolvit liceul cu un atestat de limba engleză nivel B2 si in prezent sunt studenta la Facultatea de Limbi si Literaturi Straine. Pregatirea poate fi atat pentru orele de la scoala, cat si pentru pregatirea in vederea unui examen lingvistic. Durata unei ședințe poate fi adaptată ( 1h-2h ).','o ora','2023-10-08 00:11:59',50,'Bucuresti','Bucuresti','','mai putin de un an',1,0,1,10,0,NULL,NULL),(179,247,'Limba franceza','Meditatii Franceza','Buna! Ofer meditatii la limba franceza pentru elevii care doresc sa se pregateasca pentru orele de franceza de la scoala/liceu sau in vederea unui examen lingvistic, de nivel A1/A2/B1/B2. Sunt studenta in anul I la Facultatea de Limbi si Literaturi Straine din cadrul Universitatii din Bucuresti si am obtinut nivelul B2 de franceza la examenul DELF. Durata unei ședințe poate fi adaptată ( 1h-2h).','o ora','2023-10-08 00:12:01',50,'Bucuresti','Bucuresti','','mai putin de un an',1,0,1,11,0,NULL,NULL),(180,248,'Matematica','Meditatii Matematica Bacalaureat/Liceu','Salut! Numele meu este Darius, și sunt student în anul 3 la Facultatea de Inginerie Medicală, în cadrul Universității Politehnica din București. Cu pasiune pentru matematică și dorința de a ajuta elevii să obțină rezultate excelente, ofer meditații la matematică pentru clasele 9-12, cu accent pe pregătirea pentru examenul de bacalaureat.\r\nCe ofer:\r\n* Pregătire pentru toate profilele: mate-info, științele naturii și tehnologic.\r\n* Prima ședință este GRATUITĂ, pentru a stabili obiectivele și a ne cunoaște.\r\n* Prețul este de doar 80 lei pe ședință.\r\n* Fiecare ședință durează aproximativ 2 ore, pentru a asigura o înțelegere profundă a materiei.\r\n* Meditațiile au loc la domiciliul meu în București, Sector 2, în zona Obor/Colentina/Teiul Doamnei. Se poate discuta posbilitatea de a face la domiciliul elevului.\r\nPentru a programa prima ta ședință gratuită și pentru a discuta mai multe detalii, te rog să mă contactezi la numărul meu de telefon: 0766299314\r\nTe aștept cu entuziasm pentru a te ajuta să îți atingi potențialul maxim!','doua ore','2023-11-06 00:48:49',80,'Bucuresti','Bucuresti','Obor/Colentina/Teiul Doamnei','doi ani',0,1,1,10,0,NULL,NULL),(181,249,'Biologie','Meditații biologie pentru admiterea la medicina','Buna ziua\r\nSunt studentă la Medicină Generală în anul IV la Facultatea de Medicină și Farmacie “Carol Davila” București. \r\nOfer meditații la biologie pentru admiterea la medicină, printr-un model de învățare interactiv care va forma o gândire structurată și eficientă necesară rezolvării celor 60 de grile din cadrul examenului. \r\nVom avea o prima întâlnire pentru a stabili toate detaliile unei echipe de succes! \r\nȘedința va dura 2h/ 2h 30’ (fizic) și va include predare prin desene și materiale realizate de mine, testarea cunoștintelor și discutarea nelămuririlor din temă sau carte. După preferință, se poate lucra individual sau în grupe de maxim 3 elevi. \r\nPentru mai multe detalii, mă puteți contacta în privat.','doua ore si 30 minute','2023-10-01 03:01:01',120,'Bucuresti','Bucuresti','Sector 1','mai putin de un an',1,1,1,7,0,NULL,NULL),(182,250,'Limba si literatura romana','Meditații limba și literatura română','Ofer meditații pentru Evaluarea Națională și Bacalaureat la domiciliul meu. Tel. 0742307963','doua ore','2023-10-11 19:20:33',120,'Bucuresti','Bucuresti','Colentina','zece ani',0,0,1,9,0,NULL,NULL),(183,251,'Matematica','Pregătire la matematică, Liceu ','Buna! Numele meu este Xenia. In prezent sunt studenta la facultatea de Automatica si Calculatoare, Bucuresti, anul 3. In liceu am fost pe specializarea matematica-informatica, având întotdeauna o înclinație mai mare spre matematica. \r\nMulti ani am avut tangenta cu copii de toate vârstele, fiind voluntar in tabere vara timp de 6 ani. Îmi place sa lucrez cu ei si reușesc sa am răbdare si sa îmi dau seama unde au neclarități, in ciuda timidități lor de a spune.\r\nDacă vrei sa vezi cât de ușoară este matematica de fapt si cât de mult îți poate dezvolta gândirea, hai sa lucram împreună!\r\nPrima ședința va fi gratuită in care voi da un test pentru a vedea nivelul de pregătire si mai departe te ajut sa înțelegi mai bine conceptele, vom rezolva exerciții si probleme si foarte important, vei primi tema, pentru ca lucrul individual este si mai important decât meditația in sine. \r\nPrefer ca orele de pregătire sa fie ținute online, având tableta grafica, dar sunt disponibilă si sa vin la domiciliul elevului.','doua ore','2023-10-05 17:38:51',90,'Bucuresti','Bucuresti','','doi ani',1,1,1,9,0,NULL,NULL),(184,252,'Limba franceza','Meditatii limba franceza ','Bună ziua! Mă numesc Andreea. Am absolvit Facultatea de Limbi și Literaturi Străine din cadrul Universității din București,specializarea Franceză-Română,și de asemenea,Masteratul Didactic în limba franceză. Ofer meditații la limba franceză atât pentru gimnaziu, cât și pentru liceu. Lecțiile se vor desfășura în format online și vor acoperi cele patru competențe ale limbii franceze: scris, vorbit, înțelegere orală și scrisă. Preț ședință: 100 lei. Pentru mai multe detalii,mă puteți contacta la numărul de telefon: 0785906339. Vă mulțumesc!','doua ore si 30 minute','2023-10-06 03:03:08',100,'Buzau','Buzau','','doi ani',1,0,1,10,0,NULL,NULL),(185,253,'Informatica','Meditatii la Informatica','Buna! Ofer meditatii la matematica, fizica si informatica elevilor de gimnaziu si de liceu. Sunt pasionata de aceste domenii, avand si rezultate la examenul de bacalaureat (nota 10 la fizica si 9.5 la matematica) si la admitere. Acum sunt studenta la Facultatea de Matematica si Informatica (domeniul Calculatoare si Tehnologia Informatiei) in anul 2. Sunt o fire rabdatoare si intelegatoare, imi place sa explic concepte ce ma pasioneaza. Am experienta cu lucratul cu copii dintr-un voluntariat in care, timp de un an, am organizat si am tinut un club de lectura pentru copiii din medii defavorizate. Va astept cu mare drag!:)','o ora si 30 minute','2023-10-07 23:16:52',100,'Bucuresti','Bucuresti','Sector 3','mai putin de un an',1,0,1,5,0,NULL,NULL),(186,253,'Matematica','Meditatii la Matematica','Buna! Ofer meditatii la matematica, fizica si informatica elevilor de gimnaziu si de liceu. Sunt pasionata de aceste domenii, avand si rezultate la examenul de bacalaureat (nota 10 la fizica si 9.5 la matematica) si la admitere. Acum sunt studenta la Facultatea de Matematica si Informatica (domeniul Calculatoare si Tehnologia Informatiei) in anul 2. Sunt o fire rabdatoare si intelegatoare, imi place sa explic concepte ce ma pasioneaza. Am experienta cu lucratul cu copii dintr-un voluntariat in care, timp de un an, am organizat si am tinut un club de lectura pentru copiii din medii defavorizate. Va astept cu mare drag!:)','o ora si 30 minute','2023-10-07 23:20:48',100,'Bucuresti','Bucuresti','Sector 3','mai putin de un an',1,0,1,5,0,NULL,NULL),(187,253,'Fizica','Meditatii la Fizica','Buna! Ofer meditatii la matematica, fizica si informatica elevilor de gimnaziu si de liceu. Sunt pasionata de aceste domenii, avand si rezultate la examenul de bacalaureat (nota 10 la fizica si 9.5 la matematica) si la admitere. Acum sunt studenta la Facultatea de Matematica si Informatica (domeniul Calculatoare si Tehnologia Informatiei) in anul 2. Sunt o fire rabdatoare si intelegatoare, imi place sa explic concepte ce ma pasioneaza. Am experienta cu lucratul cu copii dintr-un voluntariat in care, timp de un an, am organizat si am tinut un club de lectura pentru copiii din medii defavorizate. Va astept cu mare drag!:)','o ora si 30 minute','2023-10-07 23:21:27',100,'Bucuresti','Bucuresti','Sector 3','mai putin de un an',1,0,1,5,0,NULL,NULL),(188,254,'Matematica','Meditații matematica','Ofer meditații clasele (1-8),la domiciliul meu sau al clientului,explic materia neînțeleasă ,ajutor in efectuarea temelor,pregătire Pt evaluare naționala cu portofoliu,fise,lucram teste evaluare ,testare și feedback părinților cu progresul făcut.','doua ore','2023-10-08 18:41:07',80,'Constanta','Constanta','Centrala','cinci ani',0,0,1,7,0,NULL,NULL),(190,256,'Alte materii','Meditații clasele pregătitoare- IV','Buna ziua! Ma numesc Iustina si sunt absolventă a liceului pedagogic, specializarea învățător-educatoare. În prezent studiez Pedagogia in cadrul Facultății de Psihologie si Stiintele Educatiei, în București. \r\nÎn paralel, ofer sprijin elevilor din clasele primare la teme, exercitii si cu privire la orice continut de la orice materie, ce are nevoie de clarificare și înțelegere suplimentară. \r\nDe asemenea, ofer meditatii și la limba și literatura română pentru clasele V-VIII. \r\nActivitatea de desfășoară la domiciliul elevului sau online, si in curând si la domiciliul meu. Zona vizată este în principiu sectorul 6, insa pot face exceptii. ','o ora si 30 minute','2023-10-10 00:14:28',100,'Bucuresti','Bucuresti','','patru ani',1,1,1,6,0,NULL,NULL),(191,257,'Istorie','MEDITATIE ISTORIE','Ofer meditații tuturor celor ce doresc o pregătire temeinică pentru examenul de Bacalaureat la Istorie, și mai ales pentru examenul scris din cadrul admiterii la Academia de Poliție.  + TG OCNA PENITENCIARE\r\nMenționez că am avut 9.90 în Bacalaureat și 9.10 - nota la Istorie, în cadrul examenului scris la Academie. \r\nÎn prezent sunt studentă a facultății de Istorie din cadrul U.B., profil RISE.\r\n\r\nAm creat special pentru copii grile de dificultate mare, întrucât vizez o pregătire asiduă cu mari insistențe pe excepții și ,,chichițe’’ , care pot pica la examenul scris, la Poliție.\r\n\r\nPreț: 75 RON. Durata : 2 h. Meditatia are loc ONLINE.\r\n\r\nPentru detalii, vă astept sa comunicăm pe WHATSAPP.','doua ore','2023-10-10 05:16:26',75,'Bucuresti','Bucuresti','','doi ani',1,0,1,5,0,NULL,NULL),(192,259,'Matematica','meditatii matematica clasele V-XII','Profesoară cu experiență ,ofer meditații la matematică pentru elevii de orice nivel.\r\n\r\nMEDITAȚII LA MATEMATICĂ PENTRU:\r\n-Evaluare Naționala;\r\n-Bacalaureat: M2, M3;\r\n-clasele 4-12;\r\n\r\n\r\nVOM PUNE ACCENT PE URMĂTOARELE LUCRURI:\r\n-verificarea temelor la fiecare ședință și discutarea neclarităților;\r\n-verificarea cunoștințelor asimilate pe parcursul ședințelor prin teste și comunicarea notelor obținute părinților;\r\n-explicarea teoriei și aprofundarea prin exerciții;\r\n-teme pe timp de vacanță;\r\n-consider că o nota maximă se poate obține doar prin munca individuală pe care o depune fiecare și de aceea pun foarte mult accent pe teme.\r\n\r\nMEDITAȚIILE SE POT DESFAȘURA ASTFEL:\r\n-individual: 90 lei (2h)\r\n-in grupă de câte 2 elevi de același nivel ( 70 lei) ( 2h)\r\n-prima ședința va consta intr-un mic test/ întrebări pentru a-mi putea da seama la ce nivel este fiecare.\r\n-pentru clasele terminale (VIII, XII) vor fi ședințe ce vor consta în recapitularea întregii teorii pe care elevii trebuie să o cunoască pentru examen.\r\n\r\nLUCRURI DESPRE MINE:\r\nÎn primul rând aș vrea sa punctez faptul că este o pasiune sa lucrez cu copiii și sa le împărtășesc din cunoștințele mele. Este o satisfacție foarte mare atât pentru profesor, cât și pentru elev, atunci când se văd roadele muncii depuse. Lucrez cu copiii înca din timpul facultății și am pregătit peste 100 de elevi.\r\nCa studii, am terminat Facultatea de Matematică cu media 9.75, un master în Matematici Aplicate cu media 9,75 și modulul I și II pentru PROGRAMUL DE FORMARE PSIHOPEDAGOGICĂ.\r\nAm foarte multe materiale/fișe de lucru/manuale/culegeri de la edituri care sunt de actualitate din care vom lucra pe tot parcursul nostru.\r\nÎmi place să lucrez cu copii ambițioși, care își doresc să-și depășească nivelul și dacă este nevoie putem lua totul de la 0. Țin foarte mult la seriozitate si punctualitate.\r\n\r\nCE MĂ RECOMANDĂ?\r\n-lucrul individual sau cu un grup restrâns de elevi de acelasi nivel;\r\n-durata ședințelor de 2h ( consider că 1h 30 min este un timp prea scurt pentru a acoperi toate obiectivele propuse);\r\n-faptul ca sunt o profesoara tânără și explic ori de câte ori este nevoie;\r\n-experiență în meditații de mai bine de 7 ani;\r\n-faptul că profesez in domeniu și cunosc foarte bine materia, teoria, programa de examen și cum să stimulez interesul elevilor pentru a învăta;','doua ore','2023-10-13 20:48:26',70,'Dolj','Craiova','Craiovita','zece ani',0,0,1,8,0,NULL,NULL),(193,261,'Limba franceza','Meditatii la limba franceza','Bine ati venit pe profilul meu! Ma numesc Nicoleta si doresc sa va calauzesc pentru a invata limba franceza. \r\n\r\nAs fi incantata sa ajut copiii care doresc sa studieze aceasta limba, cat si pe cei care vor sa isi faca temele sau se pregatesc pentru examene. \r\nDe asemenea, ofer cursuri adultilor care nazuiesc sa comunice in franceza sau se pregatesc pentru interviuri de angajare. \r\n\r\nNadajduiesc sa va insuflu incredere in sine, curajul sa va exprimati si iubirea pentru aceasta limba frumoasa. \r\n\r\nVa propun o abordare a limbii franceze intr-o maniera creativa si ludica imbinand tehnici de comunicare, materiale audio video, astfel incat sa patrundeti in cultura si civilizatia franceza, in functie de disponibilitatile dumneavoastra si nivelul pe care doriti sa il atingeti. \r\n\r\nIntentionez sa va inspir, sa descoperiti prin intermediul limbii franceze sufletul acestui neam, care are inclinatii pentru rafinament, bun gust, interes pentru cultura, literatura, arta. \r\n\r\nAm urmat studii de Litere in Romania ( franceza-romana), si mi-am continuat studiile in Franta, unde am terminat un master de Litere ( Literatura) si o licenta de Istoria Artei. \r\n\r\nAm predat franceza timp de 24 de ani, in Romania si la un colegiu privat in Franta, pregatind copii pentru examene. Am facut si cursuri particulare cu adulti in vederea angajarii. \r\n\r\nDaca simtiti ca acest profil va inspira sau corespunde  cerintelor dumneavoastra va rog sa ma contactati pe email sau la numarul de telefon si voi urmari sa va raspund cat mai curand. \r\n\r\nSedintele au loc online pe whats up sau zoom.\r\nPrima sedinta este gratuita. \r\nVa astept cu drag!','o ora si 30 minute','2023-10-22 07:24:42',150,'Bucuresti','Bucuresti','','douazeci si cinci de ani',1,0,1,19,0,NULL,NULL),(194,263,'Limba germana','Meditatii Limba Germana','Meditez copii sau adulti care studiaza sau vor sa studieze limba germana, online sau la domiciliu. Materialele cu care lucrez sunt adaptate in functie de nivelul si nevoile fiecaruia, iar metoda de lucru depinde de personalitatea acestora. Garantez ca ma pot adapta rapid la orice tip de caracter si pot jongla cu metode de lucru eficiente. Ofer si cer seriozitate!','o ora si 30 minute','2023-11-03 05:19:58',100,'Bucuresti','Bucuresti','Parcul Carol','sase ani',1,0,1,9,0,NULL,NULL),(195,263,'Limba engleza','Meditatii Limba Engleza','Meditez copii sau adulti care studiaza sau vor sa studieze limba engleza, online sau la domiciliu. Materialele cu care lucrez sunt adaptate in functie de nivelul si nevoile fiecaruia, iar metoda de lucru depinde de personalitatea acestora. Garantez ca ma pot adapta rapid la orice tip de caracter si pot jongla cu metode de lucru eficiente. Ofer si cer seriozitate!','o ora si 30 minute','2023-11-03 05:20:43',100,'Bucuresti','Bucuresti','Parcul Carol','sase ani',1,0,1,8,0,NULL,NULL),(196,265,'Psihologie','Meditatii la psihologie pentru bac si admiterea la facultatea','Nu te aglomera la finalul anului! Hai să începem să învățăm împreună psihologie din timp. Ofer meditații la psihologie și gândire critică, pentru examenul de bacalaureat, pentru olimpiadă și pentru admiterea la facultate (FPSE sau SNSPA). Lucrez individual, online sau fizic, dispun de toate materialele necesare, lucrăm subiecte de bac pentru a învăța sistemul de rezolvare, iar toate grilele aferente recapitulărilor sunt făcute de mine. Am experiență în lucrul particular cu elevii și la catedră, nivel liceu. Promovabilitatea elevilor mei în anul 2023 a fost 100%. Mai am 2 locuri disponibile. ','o ora si 30 minute','2023-11-13 20:57:44',80,'Bucuresti','Bucuresti','Sector 3','doi ani',1,1,1,1,0,NULL,NULL),(197,265,'Logica','Meditatii gandire critica','Nu te aglomera la finalul anului! Hai să începem să învățăm împreună din timp. Ofer meditații la gândire critică, pentru examenul de admitere la Facultatea de Psihologie și Științele Educației, specializările Psihologie sau Științe Cognitive. Lucrez individual, online sau fizic și dispun de toate materialele necesare. Am experiență în lucrul particular cu elevii și la catedră, nivel liceu. Mai am 2 locuri disponibile.','o ora si 30 minute','2023-11-13 20:59:26',80,'Bucuresti','Bucuresti','Sector 3','doi ani',1,1,1,3,0,NULL,NULL),(198,266,'Matematica','Meditatii matematica 100 lei/o ora jumatate ','Ofer meditatii la matematica elevilor de clasele I-XII. Am absolvit Facultatea de Matematica si Informatica. Experiența 7 ani. Meditatiile se desfășoară la domiciliul meu sau online. Locuiesc in sectorul 3, București. Pret 100 lei/o ora jumatate ','o ora si 30 minute','2023-11-14 02:29:10',100,'Bucuresti','Bucuresti','Sector 3 București ','sapte ani',1,0,1,9,0,NULL,NULL),(199,267,'Limba engleza','Meditatii Limba Engleză, Chiajna, Copii 5-10 Ani','Ofer meditatii la limba engleza pentru copii, cu varsta cuprinsa intre 5 si 10 ani. \r\n\r\nIubesc copiii, interactionez bine cu ei si am creat aceste lectii pentru a îndeplini nevoile fiecarui copil în parte, tinand cont de cunostintele si de potentialul acestora de asimilare a informatiilor. \r\n\r\nRezultatele sunt vizibile incepând cu prima sedinta, datorită tehnicilor de predare si lectiilor interactive.\r\n\r\nIn cadrul meditatiilor vom lucra: \r\n-vocabular \r\n-gramatica\r\n-literatura\r\n-pe structura vorbit-scris-citit-ascultat. \r\n\r\nSunt specializata si in art-coaching pentru copii ceea ce imi ofera avantajul de a interactiona cu copiii intr-un mod mult mai creativ si a le face placuta si distractiva limba engleza.:-)\r\n\r\nOrele de meditatii se tin la sediul din Chiajna (vis-à-vis de gradinita/scoala gimnaziala Petru Rares, str. Gentianei, Dudu, Chiajna) sau online.\r\n\r\nPret: 95lei/ 1 ora si 30 de minute.\r\n','o ora si 30 minute','2023-11-14 05:15:37',95,'Bucuresti','Bucuresti','Chiajna, Ilfov','cinci ani',1,0,1,25,1,'2023-11-13 17:20:59','2024-01-13 17:20:07'),(200,269,'Informatica','Antrenez Elevi Harnici','Antrenez (in limba romana, franceza sau engleza) elevi harnici, seriosi si pasionati de programming in vederea pregatirii pentru teste nationale de evaluare, pentru concursuri de informatica, bacalaureat, admitere in liceu, admitere in facultate sau interviuri corporate. Vom rezolva peste 500 de probleme, propuse la olimpiadele judetene(OJI), nationale(ONI) si internatioanale(IOI), prevalandu-ne de platformele Infoarena, PBinfo, Codeforces si csacademy. Limbaje de programare: PHP8.2 / Java18 / C / C++11 / Assembly / Python3 / JavaScript / Rust / R / Kotlin on Android / React / Angular / Vue. Topics: Artificial Intelligence, Algorithms, Data Structures, Object Oriented Programming, programare structurata, Machine Learning, Deep Learning. Am experienta in Computer Science peste 20 de ani.In timpul liceului am participat la olimpiade de matematica, fizica si informatica. Am predat la cele mai prestigioase licee din Bucuresti: Colegiul Virgil Madgearu, Colegiul C.A. Rosetti, Liceul Dimitrie Cantemir, Colegiul National Sf. Sava. Momentan lucrez in Django Python pentru o company din Australia. Sunt co-author la o carte de matematica pentru nivel preuniversitar. La capatul acestui periplu, daca elevul este docil si sanguincios, voi garanta un salt calitativ de cunostinte pana la nivel Oxford, Cambridge, Princeton sau Harvard adaugand, poate, un metru staturii sale interioare. Prima sesiune(1h30min) de lucru va fi gratis.','mai mult de patru ore','2023-11-21 04:00:40',100,'Bucuresti','Bucuresti','Orice zona','douazeci de ani',1,1,1,4,0,NULL,NULL),(201,269,'Programare','Antrenez Elevi Harnici','Antrenez (in limba romana, franceza sau engleza) elevi harnici, seriosi si pasionati de programming in vederea pregatirii pentru teste nationale de evaluare, pentru concursuri de informatica, bacalaureat, admitere in liceu, admitere in facultate sau interviuri corporate. Vom rezolva peste 500 de probleme, propuse la olimpiadele judetene(OJI), nationale(ONI) si internatioanale(IOI), prevalandu-ne de platformele Infoarena, PBinfo, Codeforces si csacademy. Limbaje de programare: PHP8.2 / Java18 / C / C++11 / Assembly / Python3 / JavaScript / Rust / R / Kotlin on Android / React / Angular / Vue. Topics: Artificial Intelligence, Algorithms, Data Structures, Object Oriented Programming, programare structurata, Machine Learning, Deep Learning. Am experienta in Computer Science peste 20 de ani.In timpul liceului am participat la olimpiade de matematica, fizica si informatica. Am predat la cele mai prestigioase licee din Bucuresti: Colegiul Virgil Madgearu, Colegiul C.A. Rosetti, Liceul Dimitrie Cantemir, Colegiul National Sf. Sava. Momentan lucrez in Django Python pentru o company din Australia. Sunt co-author la o carte de matematica pentru nivel preuniversitar. La capatul acestui periplu, daca elevul este docil si sanguincios, voi garanta un salt calitativ de cunostinte pana la nivel Oxford, Cambridge, Princeton sau Harvard adaugand, poate, un metru staturii sale interioare. Prima sesiune(1h30min) de lucru va fi gratis.','mai mult de patru ore','2023-11-21 04:03:00',100,'Bucuresti','Bucuresti','Orice zona','douazeci si cinci de ani',1,1,1,2,0,NULL,NULL),(202,157,'Economie','meditatii ASE','Ofer meditatii online pentru urmatoarele materii: 1) INGINERIE FINANCIARA, 2) Finantele intreprinderii / Finante corporative / Gestiunea financiara a intreprinderii, 3) Corporate Finance si International Corporate Finance, 4) Finante publice, 5) Fiscalitate, 6) Politici financiare publice, 7) Microeconomie, 8) Macroeconomie, 9) Analiza economico-financiara I si II, 10) Marketing, 11) Investitii directe, 12) Relatii monetar-financiare internationale (RMFI), 13) Piete de capital, 14) Gestiunea portofoliului, 15) Tehnici si operatiuni bancare, 16) Gestiunea bancara, 17) Modelare cantitativa, 18) Microeconomie cantitativa, 19) Macroeconomie cantitativa, 20) Statistica, 21) Econometrie, 22) Asigurari si reasigurari, 23) Introducere in contabilitate, 24) Contabilitate aprofundata, 25) Contabilitate financiara, 26) Contabilitate manageriala, 27) Contabilitatea bancara, 28) Contabilitatea institutiilor de credit, 29) Evaluarea intreprinderii','o ora si 30 minute','2023-11-23 02:13:31',110,'Bucuresti','Bucuresti','online','zece ani',0,0,1,0,0,NULL,NULL);
